INSERT INTO `cw_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(1, 43, 'HTML', 'html', '<p style="text-align: justify;">\r\n	<strong>Apa itu HTML?</strong></p>\r\n<p style="text-align: justify;">\r\n	HyperText Markup Language (HTML) adalah sebuah bahasa markah yang digunakan untuk membuat sebuah halaman web, menampilkan berbagai informasi di dalam sebuah penjelajah web Internet dan pemformatan hiperteks sederhana yang ditulis dalam berkas format ASCII agar dapat menghasilkan tampilan wujud yang terintegerasi. Dengan kata lain, berkas yang dibuat dalam perangkat lunak pengolah kata dan disimpan dalam format ASCII normal sehingga menjadi halaman web dengan perintah-perintah HTML.</p>\r\n', '\r\n<p>\r\n	Bermula dari sebuah bahasa yang sebelumnya banyak digunakan di dunia penerbitan dan percetakan yang disebut dengan SGML (Standard Generalized Markup Language), HTML adalah sebuah standar yang digunakan secara luas untuk menampilkan halaman web. HTML saat ini merupakan standar Internet yang didefinisikan dan dikendalikan penggunaannya oleh World Wide Web Consortium (W3C). HTML dibuat oleh kolaborasi Caillau TIM dengan Berners-lee Robert ketika mereka bekerja di CERN pada tahun 1989 (CERN adalah lembaga penelitian fisika energi tinggi di Jenewa).</p>\r\n<p style="text-align: justify;">\r\n	<strong>Penamaan Dokumen</strong><br />\r\n	&nbsp;Untuk penamaan HTML kita bisa menggunakan sebuah ekstensi tambahan seperti ".htm" atau ".html" (tanda petik jangan ditulis)</p>\r\n<p style="text-align: justify;">\r\n	<strong>Contoh dokumen HTML sederhana</strong></p>\r\n<pre class="brush:html">&lt;!DOCTYPE html&gt;\r\n&lt;html&gt;\r\n  &lt;head bgcolor=black text=white&gt;\r\n    &lt;title&gt;Halo Dunia&lt;/title&gt;\r\n  &lt;/head&gt;\r\n  &lt;body&gt;\r\n    &lt;p&gt;Halo Dunia&lt;/p&gt;\r\n  &lt;/body&gt;\r\n&lt;/html&gt;\r\n</pre>\r\n<p>\r\n	Sumber: <a href="https://id.wikipedia.org/wiki/HTML">Wikipedia</a></p>\r\n<p>\r\n	&nbsp;</p>\r\n', 1, 8, '2013-04-12 15:39:21', 129, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-04-12 15:39:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 7, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 44, 'Tag-Tag HTML', 'tag-tag-html', '<p style="text-align: justify;">\r\n	Tag dasar dari HTML itu terdiri atas teks yang berisi informasi.</p>\r\n<p style="text-align: justify;">\r\n	Judul utama atau topiknya disimpan di dalam section atau elemen head, disimpan dalam elemen title. Nah title ini sendiri akan ditampilkan pada bagian caption dari jendela browser web. Hanya elemen title saja dari elemen head yang ditampilkan di browser, elemen lainnya dari head tidak ditampilkan, sebagai elemen yang menjelaskan tentang dokumen HTML yang bersangkutan</p>\r\n', '\r\n<p style="text-align: justify;">\r\n	Teks informasi ini akan disimpan dalam section atau elemen body di dalam tag &lt;body&gt; dan &lt;/body&gt;. Teksnya sendiri disusun di dalam paragraf-paragraf atau tag &lt;p&gt;. Teks juga mempunyai judul-judul yang menunjukkan topik-topik atau bagian-bagian dalam dokumen HTML di dalam tag Heading atau &lt;h1&gt; sampai dengan &lt;h6&gt;</p>\r\n<p style="text-align: justify;">\r\n	<strong>HTML:</strong> Adalah tag utama yang mendefinisikan bahwa dokumen ini adalah dokumen HTML. Tag ini merupakan sesuatu yang wajib di tulis saat pertama kali menulis pemogramannya di dokumen HTML.</p>\r\n<p style="text-align: justify;">\r\n	<strong>Head:</strong> Adalah tag yang di tuliskan setelah tag &lt;html&gt; untuk menuliskan keterangan tentang dokumen web yang ditampilkan.</p>\r\n<p style="text-align: justify;">\r\n	<strong>Title:</strong> Adalah tag yang di tulis di dalam tag &lt;head&gt; untuk memberikan judul pada caption browser mengenai judul dari dokumen web yang akan di tampilkan<br />\r\n	Body: Adalah sebagai section utama dalam dokumen web. Pada tag &lt;body&gt; semua isi dokumen akan ditampilkan di dalam browser.</p>\r\n<p style="text-align: justify;">\r\n	<strong>Paragraf:</strong> Infomasi yang disajikan dalam dokumen harus mengikuti kaidah-kaidah dalam penulisan. Misal suatu pemikiran utama disimpan dalam satu paragraf.<br />\r\n	Setiap paragraf pasti dimulai dari tag &lt;p&gt; dan diakhiri dengan tag &lt;/p&gt;. Lalu untuk paragraf baru harus dimulai oleh tag &lt;p&gt; kembali.</p>\r\n', 1, 8, '2013-04-12 15:39:54', 129, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-04-12 15:39:54', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 5, '', '', 1, 2, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 45, 'Coba HTML', 'coba-html', '<p style="text-align: justify;">\r\n	Oke sekarang kita akan mencoba sebuah file HTML sederhana, karena disini saya mengguanakan Linux, maka coding HTML ini saya tulis dengan menggunakan kwrite/gedit/nano/vim/vi (tergantung selera masing-masing).Hehe dan untuk pengguna windows bisa menyesuaikan Sekarang coba anda tulis coding di bawah ini (ingat jangan copy paste ya kalau mau belajar) dengan misal gedit, lalu simpan di desktop anda dengan nama coba.html</p>\r\n', '\r\n<p style="text-align: justify;">\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt;\r\n&lt;head&gt;\r\n&lt;title&gt;COBA HTML&lt;/title&gt;\r\n&lt;/head&gt;\r\n&lt;body&gt;\r\n&lt;p&gt;INI ADALAH SATU BARIS PARAGRAF&lt;/p&gt;\r\n&lt;body&gt;\r\n&lt;/html&gt;</pre>\r\n<p style="text-align: justify;">\r\n	Setelah codingan di atas anda simpan di Desktop Linux anda dengan nama coba.html. Maka sekarang coba buka file itu. Maka seharusnya akan tampil di dalam browser, contoh kali ini saya mengguanakan chromonium&nbsp;Gampang kan? <img alt="wink" height="20" src="http://127.0.0.1/CodeWeb/plugins/editors/jckeditor/plugins/smiley/images/wink_smile.gif" title="wink" width="20" />&nbsp;Tunggu artikel selanjutnya ya</p>\r\n<p style="text-align: center;">\r\n	<img alt="" src="http://i1317.photobucket.com/albums/t637/Imron02/Joomla/a_zps51b588a9.png" style="width: 500px; margin: 4px; height: 244px;" /></p>\r\n', 1, 8, '2013-04-12 15:43:54', 129, '', '2013-04-12 15:56:58', 129, 0, '0000-00-00 00:00:00', '2013-04-12 15:43:54', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 6, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(4, 46, 'Kumpulan Tag-tag HTML', 'kumpulan-tag-tag-html', '<h4 style="text-align: justify;">\r\n	Line Break</h4>\r\n<p style="text-align: justify;">\r\n	Apa itu Line Break, Line Break adalah suatu nama untuk pengkodingan ganti baris di dalam dokumen HTML. Jadi maksudnya ganti baris ini cuma menyajukan informasi pada baris tersendiri tetapi tidak mengganti si paragrafnya. Nah untuk menampilkan suatu teks pada baris baru dalam suatu paragraf, maka kita harus menambahkan suatu tag &lt;br /&gt;.</p>\r\n', '\r\n<p style="text-align: justify;">\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt;\r\n&lt;head&gt;\r\n&lt;title&gt;Coba Line Break&lt;/title&gt;\r\n&lt;/head&gt;\r\n&lt;body&gt;\r\n&lt;p&gt;Coba ganti baris&lt;br /&gt;\r\nDi satu paragraf&lt;br /&gt;\r\ndengan memakai tag br.&lt;/p&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;  </pre>\r\n<p style="text-align: justify;">\r\n	Dan inilah penampakan dari coding di atas.Hehe</p>\r\n<p style="text-align: center;">\r\n	<img alt="" src="http://i1317.photobucket.com/albums/t637/Imron02/Joomla/a_zps270be15c.png" style="width: 500px; height: 258px;" /></p>\r\n<h4 style="text-align: justify;">\r\n	Heading</h4>\r\n<p style="text-align: justify;">\r\n	Nah apa si heading itu? Heading itu di dalam dokumen HTML ibaratnya suatu judul dari suat topik dalam dokumen HTML. Heading itu sendiri ditampilkan dengan ukuran huruf yang lebih besar dan ditebalkan. Oya bisa juga heading digunakan untuk menunjukkan tingkat keberartian dari teks yang telah kita tulis. Heading itu sendiri mempunya 6 tingkatan, tingkatannya itu dimulai dari satu sampai 6. Nomor 1 itu menunjukan untuk heading yang terbesar dan nomor 6 untuk heading yang terkecil. <!--more-->Sintaks elemen dari heading: &lt;hx&gt;Teks yang menjadi heading&lt;/hx&gt;, dimana x adalah nomor heading&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Contoh Heading&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;h1&gt;Ini heading&lt;/h1&gt; \r\n&lt;h2&gt;Ini heading&lt;/h2&gt; \r\n&lt;h3&gt;Ini heading&lt;/h3&gt; \r\n&lt;h4&gt;Ini heading&lt;/h4&gt; \r\n&lt;h5&gt;Ini heading&lt;/h5&gt; \r\n&lt;h6&gt;Ini heading&lt;/h6&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p style="text-align: justify;">\r\n	Dan hasilnya bisa di lihat:</p>\r\n<h1 style="text-align: justify;">\r\n	This is heading 1</h1>\r\n<h2 style="text-align: justify;">\r\n	This is heading 2</h2>\r\n<h3 style="text-align: justify;">\r\n	This is heading 3</h3>\r\n<h4 style="text-align: justify;">\r\n	This is heading 4</h4>\r\n<h5 style="text-align: justify;">\r\n	This is heading 5</h5>\r\n<h6 style="text-align: justify;">\r\n	This is heading 6</h6>\r\n<p style="text-align: justify;">\r\n	Catatan: <q><b>Selalu gunakan tag heading ini hanya untuk heading, dan jangan sekali-kali menggunakan tag heading hanya untuk memperbesar suatu tulisan/teks.</b></q></p>\r\n<h4 style="text-align: justify;">\r\n	Mengatur Letak Heading</h4>\r\n<p style="text-align: justify;">\r\n	Nah ternyata tag heading itu bisa di atur atributnya, misal heading akan di tampilkan di kiri (left), kanan (right), dan tengah (center). Dan ini dia sintaksnya:</p>\r\n<p style="text-align: justify;">\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt;\r\n&lt;head&gt; \r\n&lt;title&gt;Contoh Heading dengan alignment&lt;/title&gt;\r\n&lt;/head&gt; \r\n&lt;body&gt;\r\n&lt;h1 align="left"&gt;Heading di kiri&lt;/h1&gt; \r\n&lt;p&gt;Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading &lt;/p&gt; &lt;h1 align="right"&gt;Heading di kanan&lt;/h1&gt; \r\n&lt;p&gt;Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading &lt;/p&gt; &lt;h1 align="center"&gt;Heading di kiri&lt;/h1&gt; \r\n&lt;p&gt;Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading &lt;/p&gt; heading left adalah posisi default apabila atribut heading tidak di tuliskan &lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p style="text-align: justify;">\r\n	Dan ini dia hasilnya:</p>\r\n<h3 style="text-align: justify;">\r\n	Heading di kiri</h3>\r\n<p style="text-align: justify;">\r\n	Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading</p>\r\n<h3 style="text-align: right;">\r\n	Heading di kanan</h3>\r\n<p style="text-align: justify;">\r\n	Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading</p>\r\n<h3 style="text-align: center;">\r\n	Heading di tengah</h3>\r\n<p style="text-align: justify;">\r\n	Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading Ini adalah heading heading left adalah posisi default apabila atribut heading tidak di tuliskan</p>\r\n<h4 style="text-align: justify;">\r\n	Garis Mendatar</h4>\r\n<p style="text-align: justify;">\r\n	Dalam hal ini, dokumen html bisa disisipkan sebuah garis untuk pemisah antarbagian atau paragraf. Kode yang dipakai adalah tag &lt;hr&gt; Contoh sintaksnya:</p>\r\n<p style="text-align: justify;">\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Line Horizontal&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;p&gt;Ini adalah paragraf&lt;/p&gt; \r\n&lt;hr&gt; \r\n&lt;p&gt;Ini adalah paragraf&lt;/p&gt; \r\n&lt;hr&gt; \r\n&lt;p&gt;Ini adalah paragraf&lt;/p&gt; \r\n&lt;hr&gt; \r\n&lt;/body&gt;\r\n&lt;/html&gt;</pre>\r\n<p style="text-align: justify;">\r\n	Hasilnya: Ini adalah paragraf</p>\r\n<hr />\r\n<p style="text-align: justify;">\r\n	Ini adalah paragraf</p>\r\n<hr />\r\n<p style="text-align: justify;">\r\n	Ini adalah paragraf</p>\r\n<hr />\r\n<p style="text-align: justify;">\r\n	<b>Keterangan:</b> Garis yang disisipkan dapat dalam bentuk penggaris karena lebarnya dapat di atur, ukuran garis pun bisa dalam bentuk point atau dalam bentuk relatif window browser.</p>\r\n<h4 style="text-align: justify;">\r\n	Komentar</h4>\r\n<p style="text-align: justify;">\r\n	Dalam suatu dokumen informasi pasti ada sebagian teks yang diberikan catatan khusus atau disini saya sebut sebagai komentar. Komentar ini di dalam tag html tidak akan ditampilkan melainkan disembunyikan, penulisan tag komentar ditandai dengan tag &lt;!-- sebagai tag awal, kemudian di isi teks komentarnya, lalu di akhiri dengan --&gt; tag akhir. Contoh sintaksnya:</p>\r\n<p style="text-align: justify;">\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Komentar&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;!-- Komentar ini tidak akan tampil --&gt; \r\n&lt;p&gt;Ini adalah paragraf&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n<p style="text-align: justify;">\r\n	Hasilnya adalah: <!-- Komentar ini tidak akan tampil -->Ini adalah paragraf</p>\r\n<h4 style="text-align: justify;">\r\n	Tag-tag dasar HTML</h4>\r\n<table border="1" width="500">\r\n	<tbody>\r\n		<tr>\r\n			<th style="text-align: left;">\r\n				Tag Awal</th>\r\n			<th style="text-align: left;">\r\n				Fungsi</th>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;html&gt;</td>\r\n			<td>\r\n				Definisi untuk sebuah dokumen HTML</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;body&gt;</td>\r\n			<td>\r\n				Definisi untuk body dokumen</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&amp;lth1&gt;-&lt;h6&gt;</td>\r\n			<td>\r\n				Definisi untuk heading (judul) dari 1 s/d 6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;p&gt;</td>\r\n			<td>\r\n				Definisi untuk paragraf</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;br /&gt;</td>\r\n			<td>\r\n				Definisi untuk line break</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;hr&gt;</td>\r\n			<td>\r\n				Definisi untuk horizontal line</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;!--&nbsp;&nbsp;--&gt;</td>\r\n			<td>\r\n				Definisi untuk komentar dalam sintaks</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', 1, 8, '2013-04-12 16:18:12', 129, '', '2013-04-12 16:21:28', 129, 0, '0000-00-00 00:00:00', '2013-04-12 16:18:12', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 4, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 47, 'Format Teks HTML', 'format-teks-html', '<p>\r\n	Oke di dalam dokumen HTML dapat di format secara tersendiri untuk menunjukkan perbedaan dari isi dan maksud teksnya itu. Contohnya teks yang ditampilkan dengan huruf tebal, garis bawah, dan miring atau dll. Berikut adalah contoh pemformatan teks di dalam dokumen HTML&lt;html&gt;&nbsp;</p>\r\n<pre class="brush:xml">&lt;head&gt; \r\n&lt;title&gt;Contoh Pemformatan HTML&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;b&gt;Teks ini ditulis dengan huruf tebal&lt;/b&gt;&lt;br /&gt; \r\n&lt;i&gt;Teks ini ditulis dengan huruf miring&lt;/i&gt;&lt;br /&gt;\r\n&lt;u&gt;Teks ini ditulis dengan huruf underline (garis bawah)&lt;/u&gt;&lt;br /&gt;\r\n&lt;strong&gt;Teks ini ditulis dengan huruf strong (tebal)&lt;/strong&gt;&lt;br /&gt;\r\n&lt;em&gt;Teks ini ditulis dengan huruf emphasize&lt;/em&gt; &lt;br /&gt;\r\n&lt;small&gt;Teks ini ditulis dengan huruf kecil&lt;/small&gt; &lt;br /&gt;\r\n&lt;big&gt;Teks ini ditulis dengna huruf besar&lt;/big&gt; &lt;br /&gt;\r\nTeks ini ditulis dengan &lt;sub&gt;subscript&lt;/sub&gt; &lt;br /&gt;\r\nTeks ini ditulis dengan &lt;sup&gt;superscript&lt;/sup&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n', '\r\n<p>\r\n	&nbsp;</p>\r\n<blockquote>\r\n	Hasilnya: <strong>Teks ini ditulis dengan huruf tebal</strong><br />\r\n	<em style="font-size: 12pt; line-height: 1.2em;">Teks ini ditulis dengan huruf miring</em><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em; text-decoration: underline;">Teks ini ditulis dengan huruf underline (garis bawah)</span><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em;"> </span><strong style="font-size: 12pt; line-height: 1.2em;">Teks ini ditulis dengan huruf strong (tebal)</strong><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em;"> </span><em style="font-size: 12pt; line-height: 1.2em;">Teks ini ditulis dengan huruf emphasize</em><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em;"> </span><small style="line-height: 1.2em;">Teks ini ditulis dengan huruf kecil</small><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em;"> </span><big style="line-height: 1.2em;">Teks ini ditulis dengan huruf besar</big><span style="font-size: 12pt; line-height: 1.2em;"> Teks ini ditulis dengan </span><sub style="line-height: 1.2em;">subscript</sub><br />\r\n	<span style="font-size: 12pt; line-height: 1.2em;"> Teks ini ditulis dengan </span><sup style="line-height: 1.2em;">superscript</sup></blockquote>\r\n<h3>\r\n<!--more-->	Teks Preformat</h3>\r\n<p>\r\n	Jarak yang standart untuk antar teks atau kalimat di dalam dokumen HTML adalah satu spasi. Walaupun kita mengetik beberapa kali spasi, maka tetap saja di browser akan menampilkannya dalam satu spasi. Nah bagaimana agar browser web menampilkan agar sesuai dengan yang kita tuliskan di dalam dokumen HTML? Jawabannya adalah dengan menggunakan tag &lt;pre&gt; dan diakhiri dengan &lt;/pre&gt;. Tag pre itu kepanjangan dari<q>Preformatted</q>, dengan tag itu maka browser web akan menjaga spasi, baris baru, dan tab sesuai dengan aslinya yang di ketikkan di dokumen HTML. Contoh source codenya:&lt;html&gt;&nbsp;</p>\r\n<pre class="brush:xml">&lt;body&gt; \r\n&lt;pre&gt; include &lt;iostream&gt;\r\nusing namespace std; \r\nint main() { \r\ncout&gt;&gt;Hello World;\r\n } \r\n&lt;/pre&gt; \r\n&lt;/body&gt;\r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<pre>   include\r\nusing namespace std;\r\nint main()\r\n{\r\ncout&gt;&gt;"Hello World";\r\n}</pre>\r\n<h3>\r\n	Address</h3>\r\n<p>\r\n	Alamat (address) adalah salah satu dari elemen yang umum dalam dokumen. Untuk HTML sendiri, tag address di sediakan secara khusus. Dengan adanya tag ini, maka penulisan pun dapat di standarkan. Adapun penulisannya sendiri di awali dengan tag &lt;address&gt;, dan diakhiri dengan tag &lt;/address&gt; Contoh:&lt;html&gt;&nbsp;</p>\r\n<pre class="brush:xml">&lt;body&gt; \r\n&lt;address&gt; Jl. Green Cove No. 5 Serpong Tangerang &lt;/address&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya adalah:</p>\r\n<blockquote>\r\n	<address>\r\n		Jl. Green Cove No. 5 Serpong Tangerang</address>\r\n</blockquote>\r\n<h3>\r\n	Singkatan</h3>\r\n<p>\r\n	Dalam menulis suatu dokumen, pasti kadang-kadang kita menuliskan singkatan (akronim) di suatu istilah. Nah ternyata dalam tag HTML, untuk singkatan itu sendiri mempunyai tag tersendiri yaitu tag &lt;abbr&gt; dan tag &lt;acronym&gt; kode:&lt;html&gt;</p>\r\n<pre class="brush:xml">&lt;abbr title="kepanjangannya"&gt;Singkatannya&lt;/abbr&gt;&lt;br /&gt;\r\n&lt;acronym title="kepanjangannya"&gt;Singkatannya&lt;/acronym&gt;\r\n</pre>\r\n<p>\r\n	Dengan menggunakan tag di atas, maka pada saat mouse kita berada di atas teks singkatan tersebut, maka kepanjangan dari singkatan tersebut akan ditampilkan mengambang di atas teks singkatannya. Contoh:&lt;html&gt;&nbsp;</p>\r\n<pre class="brush:xml">&lt;body&gt; \r\n&lt;abbr title="tersebut"&gt;Tsb&lt;/abbr&gt;&lt;br /&gt; \r\n&lt;acronym title="Hyper Text Markup Language"&gt;Http&lt;/acronym&gt; \r\n&lt;p&gt;Untuk beberapa browser atribut dari tag di atas apabila mouse berada di teks singkatannya maka teks kepanjangannya akan ditampilkan&lt;/p&gt;\r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	<abbr title="tersebut">Tsb</abbr> <acronym title="Hyper Text Markup Language">Http</acronym> Untuk beberapa browser atribut dari tag di atas apabila mouse berada di teks singkatannya maka teks kepanjangannya akan ditampilkan</blockquote>\r\n<h3>\r\n	Arah Teks</h3>\r\n<p>\r\n	Dalam tampilan dokumen HTML kan biasanya teks itu ditampilkan di browser dengan arah dari kiri kekanan, nah ternyata pada kasus ini terdapaHt tag html untuk menampilkan tulisan dari kanan ke kiri. Mungkin seperti tulisan arab kali ya? Yang cara baca tulisannya dari kanan ke kiri. Sedangkan tag yang digunakan dalam penulisan ini adalah &lt;bdo&gt; atau disebut sebagai bidirectional override. Dan atributnya pun terdiri dari <q>rtl</q> atau <q>right to left</q> dan <q>ltr</q> atau <q>left to right</q>. Contoh:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt;Jika browser mendukung tampilan (bdo) ini, maka teks di bawah ini akan ditulis dari kanan ke kiri (rtl):&lt;/p&gt; \r\n&lt;bdo dir="rtl"&gt; Ini adalah teks Hebrew &lt;/bdo&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	<p>\r\n		Jika browser mendukung tampilan (bdo) ini, maka teks di bawah ini akan ditulis dari kanan ke kiri (rtl):&nbsp;</p>\r\n	<bdo dir="rtl">Ini adalah teks Hebrew</bdo></blockquote>\r\n<h3>\r\n	Quotation</h3>\r\n<p>\r\n	Suatu kutipan di dokumen HTML itu terbagi menjadi dua jenis. yaitu:</p>\r\n<ol>\r\n	<li>\r\n		Kutipan pendek atau ditulis dengan tag &lt;q&gt;</li>\r\n	<li>\r\n		Kutipan panjang atau ditulis dengan tag &lt;blockquote&gt;</li>\r\n</ol>\r\n<p>\r\n	Biasanya tag &lt;blockquote&gt; digunakan untuk menampilkan teks dalam format tersendiri. Misalnya adanya perubahan pada margin atau pewarnaan tersendiri pada teks &lt;blockquote&gt; itu. Sedangkan tag &lt;q&gt; biasanya hanya menampilkan teks dengan tanda kutip dua di atasnya. Contoh:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;blockquote&gt; Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan &lt;/blockquote&gt; \r\nDan ini dengan menggunakan tag &amp;lt;q&amp;gt;: &lt;br /&gt;\r\n&lt;q&gt;Ini adalah kutipan pendek&lt;/q&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	<blockquote>\r\n		Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan Teks dengan kutipan teks dengan kutipan</blockquote>\r\n	Dan ini dengan menggunakan tag &lt;q&gt;: <q>Ini adalah kutipan pendek</q></blockquote>\r\n<h3>\r\n	Teks sisipan atau dihapus</h3>\r\n<p>\r\n	Biasanya untuk menandakan teks yang dihapus atau disisipkan pada sudatu dokumen, maka kita akan menggunakan tag &lt;del&gt; untuk teks yang dihapus dan tag &lt;ins&gt; untuk teks yang disisipkan. Contoh perintahnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt;Ini adalah angka 10, ditulis dengan teks menjadi: &lt;del&gt;Sebelas&lt;/del&gt; &lt;ins&gt;Sepuluh&lt;/ins&gt; &lt;/p&gt; \r\n&lt;p&gt;Biasanya browser akan menampilkan teks yang dicoret untuk tag del dan menggaris bawahi untuk teks dengan tag ins&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	Ini adalah angka 10, ditulis dengan teks menjadi: <del>Sebelas</del> <ins>Sepuluh</ins> Biasanya browser akan menampilkan teks yang dicoret untuk tag del dan menggaris bawahi untuk teks dengan tag ins</blockquote>\r\n<h3>\r\n	Tag-tag Pemformatan HTML</h3>\r\n<table border="1">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n				Tag Awal</th>\r\n			<th>\r\n				Fungsi</th>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;small&gt;</td>\r\n			<td>\r\n				Untuk membuat tulisan kecil/small</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;b&gt;</td>\r\n			<td>\r\n				Digunakan untuk menebalkan teks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;big&gt;</td>\r\n			<td>\r\n				Untuk membesarkan ukuran teks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;em&gt;</td>\r\n			<td>\r\n				Untuk teks yang ditekan</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;i&gt;</td>\r\n			<td>\r\n				Untuk membuat teks miring/italic</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;strong&gt;</td>\r\n			<td>\r\n				Untuk membuat teks tebal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;sub&gt;</td>\r\n			<td>\r\n				Untuk teks subscript</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;sup&gt;</td>\r\n			<td>\r\n				Untuk teks superscript</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;ins&gt;</td>\r\n			<td>\r\n				Untuk teks yang disisipkan</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;del&gt;</td>\r\n			<td>\r\n				Untuk teks yang didelete/hapus</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>\r\n	Tag-tag Computer Output</h3>\r\n<table border="1">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n				Tag Awal</th>\r\n			<th>\r\n				Fungsi</th>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;code&gt;</td>\r\n			<td>\r\n				Untuk komputer kode</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;kbd&gt;</td>\r\n			<td>\r\n				Untuk teks keyboard</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;samp&gt;</td>\r\n			<td>\r\n				Untuk contoh komputer kode</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;tt&gt;</td>\r\n			<td>\r\n				Untuk teks teletype</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;var&gt;</td>\r\n			<td>\r\n				Untuk suatu variabel</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>\r\n	Tag Citation, Quotation, Definition</h3>\r\n<table border="1">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n				Tag awal</th>\r\n			<th>\r\n				Fungsi</th>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;acronym&gt;</td>\r\n			<td>\r\n				Untuk suatu akronim</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;abbr&gt;</td>\r\n			<td>\r\n				Untuk suatu singkatan</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;address&gt;</td>\r\n			<td>\r\n				Untuk menyatakan suatu alamat/address</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;bdo&gt;</td>\r\n			<td>\r\n				Untuk menyatakan arah teks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;blockquote&amp;g;</td>\r\n			<td>\r\n				Untuk menyatakan quotation panjang</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&lt;q&gt;</td>\r\n			<td>\r\n				Untuk menyatakan quotation pendek</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', 1, 8, '2013-04-12 16:32:17', 129, '', '2013-04-12 16:39:10', 129, 0, '0000-00-00 00:00:00', '2013-04-12 16:32:17', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 6, 3, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 48, 'Link HTML', 'link-html', '<p>\r\n	Nah sekarang ini saya akan membahas bagaimana cara menggunakan Link pada dokument HTML. Tag yang digunakan pada bagian ini adalah tag &lt;a&gt;, dan juga menggunakan atribut href untuk pendefinisian lokasi file HTML yang akan di link. Link dalam dokumen HTML pun terbagi menjadi 3 yaitu Link Relatif, Link absolut, dan Link dalam dokumen yang sama.</p>\r\n', '\r\n<h4>\r\n	Link Relatif</h4>\r\n<p>\r\n	Link ini biasanya digunakan apabila kita hanya melink dokumen HTML pada komputer yang sama. Misalnya kita mempunyai&nbsp; file HTML yaitu file.html yang akan di link dan terletak pada direktory yang sama. Maka link yang digunakan adalah:</p>\r\n<blockquote>\r\n	&lt;a href="file.html"&gt;File aku&lt;/a&gt;</blockquote>\r\n<h4>\r\n	Link absolut</h4>\r\n<p>\r\n	Link ini akan digunakan apabila kita ingin melink suatu dokumen HTML, akan tetapi dokumen HTML itu terletak pada website lain. Misal terletak di website wordpress dengan nama imron02.wordpress.com. Maka kodenya adalah:</p>\r\n<blockquote>\r\n	&lt;a href="http://www.imron02.wordpress.com"&gt;Imron Belajar HTML&lt;/a&gt;</blockquote>\r\n<h4>\r\n<!--more-->	Link dalam dokumen sama</h4>\r\n<p>\r\n	Link ini biasanya digunakan untuk melink dari dokumen HTML yang isinya itu panjang sekali. Sebagai contoh yang memakai ini adalah wikipedia. Atau melink dari suatu daftar isi. Contoh link yang digunakan adalah:</p>\r\n<blockquote>\r\n	&lt;a href="#namabagian"&gt;Bagian dari...&lt;/a&gt;</blockquote>\r\n<p>\r\n	Oke sekarang saya akan mencotohkan dari penggunaan jenis-jenis link di atas.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt;&lt;a href="file1.html"&gt;FIle aku&lt;/a&gt; merupakan link pada file1.html. Dengan syarat sudah membuat file1.html sebelumnya dan menyimpannya satu direktory pada file html pe link-nya.&lt;/p&gt;\r\n&lt;p&gt;&lt;a href="http://www.google.com"&gt;Google&lt;/a&gt; Ini adalah link menuju website Google.&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	<a href="file1.html">FIle aku</a> merupakan link pada file1.html. Dengan syarat sudah membuat file1.html sebelumnya dan menyimpannya satu direktory pada file html pe link-nya. <a href="http://www.google.com">Google</a> Ini adalah link menuju website Google.</blockquote>\r\n<h4>\r\n	Membuka link pada tab baru</h4>\r\n<p>\r\n	Oke sekarang saya akan menjelaskan bagaimana cara membuka link pada tab baru saat kita mengklik link tersebut. Jadi kesimpulannya, pengunjung web kita tidak akan meninggalkan web kita. Contoh:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;a href="http://www.google.com" target="_blank"&gt;www.google.com&lt;/a&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Hasilnya:</p>\r\n<blockquote>\r\n	<a href="http://www.google.com" target="_blank">www.google.com</a></blockquote>\r\n<h4>\r\n	Link pada lokasi yang sama</h4>\r\n<p>\r\n	Nah disini saya akan membahas cara untuk melink pada halaman yang sama (halaman yang itu itu juga).Hehe Contoh:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt;\r\n&lt;body&gt;\r\n&lt;p&gt;&lt;a name=atas&gt;\r\n&lt;a href=#B3&gt;Lihat Bagian 3&lt;/a&gt;\r\n&lt;/a&gt;\r\n&lt;/p&gt;\r\n&lt;b&gt;BAGIAN 1&lt;/b&gt;\r\n&lt;p&gt;BAGIAN INI ADALAH TENTANG TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIKTITIK TITIK TITIKTITIK TITIK TITIKTITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIKTITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIK TITIKTITIK TITIK TITIKTITIK TITIK