(7, 49, 'Home', 'home', '<p class="blabox-jck" style="text-align: center;">\r\n	<span style="font-size: 24px;">Selamat</span><span style="font-size: 24px;">&nbsp;Datang Di Web Code Website</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Website</em> ini adalah <em>website</em> yang ditunjukkan untuk belajar <em>programming</em>. Khususnya <em>Web Programming</em>. Kenapa <em>Web</em> Programming? Karena pemograman <em>web</em> untuk sekarang-sekarang ini semakin populer beserta kemajuan teknologi yang begitu cepatnya, selain itu bahasa pemograman <em>web</em> adalah bahasa pemograman yang <em>multi platform</em> atau <em>cross platform, </em>karena bisa berjalan di berbagai Sistem Operasi hanya dengan syarat tersedianya <i>browser web </i>untuk menjalankan pemograman <em>web</em>. Maka dari itu saya ingin ikut serta dalam kemajuan perkembangan dunia <em>programming web</em> ini.</p>\r\n<p>\r\n	Kita sebagai masyarakat Indonesia, khususnya yang berkecimpung di dinua TI (Teknik Informatika) tidak boleh tertinggal dengan kemajuan teknologi yang begitu pesat sekarang ini. Kita lihat saja sekarang ini sudah hal umum bagi suatu perusahaan untuk meiliki <em>website, </em>karena begitu pentingnya sekarang ini untuk memiliki website bagi suatu perusahaan, hanya dengan satu domain saja, seluruh masyarakat di dunia bisa mengaksesnya dimanapun dan kapanpun tanpa harus melakukan install-install dahulu. Website adalah suatu media yang bisa dijadikan sebagai alat untuk iklan, bisnis dan lain-lain, bahkan untuk saat ini apabila kita ingin berdiskusi tidak perlu lagi menyiapkan tempat yang luas dan waktu yang sulit untuk mengaturnya, karena sekarang ini sudah banyak forum-forum online yang bisa digunakan untuk berdiskusi dimanapun dan siapapun anda, mudah bukan?</p>\r\n<p>\r\n	Lihat saja beberapa produk website yang sangat populer seperti <a href="http://www.google.com" target="_blank">google.com</a>, <a href="http://www.yahoo.com" target="_blank">yahoo.com</a>, <a href="http://www.facebook.com" target="_blank">facebook.c</a><a href="http://www.facebook.com" target="_blank">o</a><a href="http://www.facebook.com" target="_blank">m</a>, dan masih banyak lagi yang tidak bisa disebutkan satu per satu. Belum lagi kalangan seperti pemerintahan, sekolah dan sejenisnya itu perlu mempunyai sebuah halaman web sebagai media informasi yang perlu masyarakat ketahui dan sebagai alat untuk memberikan masukan-masukan dari masyarakat. Coba bayangkan waktu dimana dulu sebelum adanya web, pasti kita akan kerepotan harus mencari sesuatu dengan membaca buku satu per satu dan mencari artikelnya. Selain itu website juga tidak selamanya baik, banyak juga yang menyalahgunakan website untuk kepentingan pribadi atau golongan dalam tindak kriminal dan kejahatan. Sebut saja banyak anak-anak atau bahkan orang dewasa yang iseng dan jail menghack website seseorang dan merugikan orang itu.&nbsp;<img alt="angry" height="20" src="http://127.0.0.1/CodeWeb/plugins/editors/jckeditor/plugins/smiley/images/angry_smile.gif" title="angry" width="20" /></p>\r\n<p>\r\n</p>\r\n<p>\r\n	Dan saya (Web Code) akan berupaya untuk menyajikan hal-hal mengenai pemograman (khususnya <em>web programming</em>) dengan pembahasan yang mudah dimengerti dan mudah dipahami. Dan apabila ada kesulitan mengenai tulisan atau artikel yang kami buat, silahkan tinggalkan komentar di form komentar.</p>\r\n<p>\r\n	Semoga <em>website </em>kami ini menjadi sebuah <em>website</em> yang berguna untuk masyarakat umum dan berguna sebagai bahan untuk pembelajaran. Dan semoga <em>website</em> ini menjadi <em>website</em> yang senantiasa memberikan informasi mengenai dunia teknologi informasi yang selalu <em>up to date </em>dan bermanfaat<em>. </em>Amin&nbsp;<img alt="smiley" height="20" src="http://127.0.0.1/CodeWeb/plugins/editors/jckeditor/plugins/smiley/images/regular_smile.gif" title="smiley" width="20" /></p>\r\n', '', 0, 2, '2013-04-14 11:44:27', 129, '', '2013-04-14 11:57:27', 129, 0, '0000-00-00 00:00:00', '2013-04-14 11:44:27', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, '', '', 1, 148, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
INSERT INTO `cw_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(8, 54, 'List HTML', 'list-html', '<p>\r\n	Oke mungkin sebelumnya kalian pada tahu apa itu list, biasanya list itu digunakan untuk mengurutkan suatu data. Nah ternyata di dalam HTML sendiri, ada juga tag untuk list ini.</p>\r\n<h3>\r\n	Ordered List</h3>\r\n<p>\r\n	Nah Ordered List itu bisa sama saja dengan pengurutan data dengan menggunakan nomor. Nah itu fungsi secara default dari Ordered List yaitu dengan nomor, tapi kita bisa merubahnya dengan menggunakan angka romawi, atau huruf. Berikut adalah contohnya: <strong>Ordered List Default</strong></p>\r\n', '\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Ordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ol&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ol&gt; \r\n&lt;/body&gt;\r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ol>\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ol>\r\n<p>\r\n	<strong><!--more-->Ordered List Huruf Romawi</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Ordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ol type="A"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ol&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ol type="A">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ol>\r\n<p>\r\n	<strong>Ordered List Nomor Romawi</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Ordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ol type="I"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ol&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	hasilnya:</p>\r\n<ol type="I">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ol>\r\n<p>\r\n	<strong>Ordered List Huruf Romawi Kecil</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Ordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ol type="a"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ol&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	hasilnya:</p>\r\n<ol type="a">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ol>\r\n<p>\r\n	<strong>Ordered List Angka Romawi Kecil</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Ordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ol type="i"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ol&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	hasilnya:</p>\r\n<ol type="i">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ol>\r\n<h3>\r\n	Unordered List</h3>\r\n<p>\r\n	Nah Unordered List ini bisa dibilang kebalikan dari Ordered List. Dia tidak menampilkan dalam bentuk angka maupun huruf. Tetapi mungkin bentuknya lebih mirip ke bullet. Berikut ini adalah contohnya: <strong>Unordered List Default</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Unordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ul&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ul&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ul>\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ul>\r\n<p>\r\n	<strong>Unordered List Disc</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Unordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ul type="disc"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt;\r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ul&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ul type="disc">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ul>\r\n<p>\r\n	<strong>Unordered List Square</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Unordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ul type="square"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ul&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ul type="square">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ul>\r\n<p>\r\n	<strong>Unordered List Circle</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Unordered List&lt;/title&gt; \r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;ul type="circle"&gt; \r\n&lt;li&gt;HTML&lt;/li&gt; \r\n&lt;li&gt;CSS&lt;/li&gt; \r\n&lt;li&gt;JavaScript&lt;/li&gt; \r\n&lt;li&gt;MySQL&lt;/li&gt; \r\n&lt;/li&gt;Php&lt;/li&gt; \r\n&lt;/ul&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya:</p>\r\n<ul type="circle">\r\n	<li>\r\n		HTML</li>\r\n	<li>\r\n		CSS</li>\r\n	<li>\r\n		JavaScript</li>\r\n	<li>\r\n		MySQL</li>\r\n	<li>\r\n		Php</li>\r\n</ul>\r\n<h3>\r\n	Definition List</h3>\r\n<p>\r\n	Definition List adalah sebuah daftar item, dengan deskripsi setiap item. Tag &lt;dl&gt;&nbsp;ini&nbsp;mendefinisikan daftar definisi. Dan tag &lt;dl&gt;&nbsp;sendiri digunakan bersama dengan &lt;dt&gt;&nbsp;(mendefinisikan item dalam daftar) dan&nbsp;&lt;dd&gt;&nbsp;(menjelaskan item dalam daftar): Ini adalah contohnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;head&gt; \r\n&lt;title&gt;Unordered List&lt;/title&gt;\r\n&lt;/head&gt; \r\n&lt;body&gt; \r\n&lt;dl&gt; \r\n&lt;dt&gt;Jeruk&lt;/dt&gt; \r\n&lt;dd&gt;- Mangga&lt;/dd&gt; \r\n&lt;tdt&gt;Manggis&lt;/dt&gt; \r\n&lt;dd&gt;- Semangka&lt;/dd&gt; \r\n&lt;/dl&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<dl>\r\n	<dd>\r\n		Dan ini dia hasilnya:\r\n		<dl>\r\n			<dt>\r\n				Coffee</dt>\r\n			<dd>\r\n				- black hot drink</dd>\r\n			<dt>\r\n				Milk</dt>\r\n			<dd>\r\n				- white cold drink</dd>\r\n		</dl>\r\n	</dd>\r\n</dl>\r\n', 1, 8, '2013-04-16 02:49:56', 129, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-04-16 02:49:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 1, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 55, 'Gambar dalam HTML', 'gambar-dalam-html', '<p>\r\n	Oke kali ini saya akan mejelaskan bagaimana cara menyisipkan sebuah gambar/image pada dokumen HTML. Nah pada saat hendak menyisipkan image/gambar itu di dokumen HTML, maka tag yang di gunakan adalah tag &lt;img src="nama_gambar"&gt; Daripada lama-lama mending kita langsung praktek aja.Hehe Ini dia contohnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;img src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Tux.png/220px-Tux.png" /&gt; \r\n&lt;p&gt;Contoh di atas adalah gambar dari si Tux&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n', '\r\n<p>\r\n	Dan ini dia hasilnya:</p>\r\n<p style="text-align: center;">\r\n	<img alt="" src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Tux.png/220px-Tux.png" style="color: rgb(84, 76, 74); font-family: Georgia; font-size: 12pt; font-style: italic; line-height: 1.2em;" /><span style="color: rgb(84, 76, 74); font-family: Georgia; font-size: 12pt; font-style: italic; line-height: 1.2em;">&nbsp;</span></p>\r\n<p>\r\n	<strong>Penjelasan:</strong> Jadi dari script HTML di atas, pada img src-nya itu menuju kesebuah URL/alamat web yang sebelumnya sudah di upload sebuah gambar. Nah bagaimana kalau ingin memakai gambar yang terletak di komputer?</p>\r\n<blockquote>\r\n	Sebenarnya mudah saja. Misal anda mempunyai gambar bernama gambarku.jpg di komputer. Nah file gambarku.jpg itu anda copy dan simpan dalam satu folder bersama script misal img.html</blockquote>\r\n<p>\r\n	Bingung? <!--more-->Lihat gambar di bawah ini: <a href="http://imron02.files.wordpress.com/2012/02/jajal.png"><img alt="img-html" class="alignnone size-medium wp-image-138" src="http://i1317.photobucket.com/albums/t637/Imron02/Joomla/a_zps4d939db7.png" style="width: 300px; height: 151px;" title="img" /></a> Tampilan di atas adalah folder img dan di dalamnya terdapat 2 buah file, yaitu gambarku.png dan img.html. Ini dia contohnya: <a href="http://imron02.files.wordpress.com/2012/02/jajal1.png"><img alt="img-html1" class="alignnone size-medium wp-image-139" src="http://imron02.files.wordpress.com/2012/02/jajal1.png?w=300" style="width: 300px; height: 151px;" title="img" /></a> Nah mengerti kan maksudnya? Sekarang edit file img.html menjadi seperti ini:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;img src="gambaruku.png" /&gt; \r\n&lt;p&gt;Contoh di atas mendemonstrasikan img src pada file gambar dengan lokasi path yang sama dengan dokumen htmlnya&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Nah ini dia kira-kira hasilnya pas file img.html dibuka: <a href="http://imron02.files.wordpress.com/2012/02/jajal2.png"><img alt="img-html2" class="alignnone size-medium wp-image-140" src="http://i1317.photobucket.com/albums/t637/Imron02/a_zpse937f501.png" style="width: 300px; height: 158px;" title="img" /></a></p>\r\n<h3>\r\n	Aignment Image</h3>\r\n<p>\r\n	Nah dari judul di atas, align image adalah mengatur pemosisian gambar pada saat ditampilkan oleh browser. Contoh:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt;Ini Adalah gambar &lt;img src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Tux.png/220px-Tux.png" align="bottom" /&gt; Si tux yang ganteng dengan align bottom (default).Hehe&lt;/p&gt; \r\n&lt;p&gt;Ini Adalah gambar &lt;img src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Tux.png/220px-Tux.png" align="middle" /&gt; Si tux yang ganteng dengan align middle.Hehe&lt;/p&gt; &lt;p&gt;Ini Adalah gambar &lt;img src="http://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Tux.png/220px-Tux.png" align="top" /&gt; Si tux yang ganteng dengan align top.Hehe&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	Hasilnya bisa di lihat di browser masing-masing ya?Hehe</p>\r\n<h3>\r\n	Floating Image</h3>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">Floating image itu sama aja dengan menampilkan gambar secara mengambang. Bisa mengambang di sebelah kiri atau kanan teks. Contoh kodenya: &lt;html&gt; &lt;body&gt; \r\n&lt;img src="gambaruku.png" align="left" /&gt; \r\n&lt;p&gt;Gambar ini akan mengambang di sebelah kiri. Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla &lt;/p&gt; \r\n&lt;img src="gambaruku.png" align="right" /&gt; \r\n&lt;p&gt;Gambar ini akan mengambang di sebelah kanan. Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla Bla bla bla bla bla bla &lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<h3>\r\n	Image Adjustment</h3>\r\n<p>\r\n	Kali ini adalah contoh bagaimana mengatur ukuran suatu image. Contohnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt; &lt;img src="gambaruku.png"  width="40" height="40" /&gt;&lt;br /&gt; \r\n&lt;img src="gambaruku.png"  width="45" height="45" /&gt;&lt;br /&gt;\r\n&lt;img src="gambaruku.png"  width="50" height="50" /&gt;&lt;br /&gt; &lt;/p&gt; \r\n&lt;p&gt; Kita dapat mengatur ukuran sebuah gambar dengan menggunakan perintah di atas, tapi alangkah lebih baiknya apabila gambar itu telah di sesuaikan dahulu dengan menggunakan aplikasi untuk meresize gambar seperti Gimp dan lain-lain. Jadi tak perlu lagi menggunakan perintah width dan height, karena untuk mempercepat proses load pada website kita. &lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<h3>\r\n	Alternative Teks Image</h3>\r\n<p>\r\n	Oke sekarang saya akan menjelaskan apa itu teks alternative image. Teks alternatife image tu biasanya digunakan apabila disaat ada seseorang yang mengakses website kita, tapi saat dia mengakses website kita itu, kemampuan menampilkan image pada browser yang digunakan itu dimatikan, jadi otomatis si pengakses itu kan gak bisa melihat gambar di website kita. Nah di sinilah fungsi dari alternative image digunakan, yaitu untuk memberitahu bahwa itu adalah sebuah gambar dengan menampilkan sebuah teks. Misal seperti saat kita mengakses 0.facebook.com, nah disitu kan gak terlihat ada gambar kan? Tapi facebook memberitahu dengan sebuah teks bertulisan <q>image</q> sekaligus dengan link-nya. Atau misal saat kita menggunakan browser yang terkenal di Linux dengan mode teksnya yaitu Lynx.. Nah daripada bingung, mending lihat dah ini dia contohnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt; \r\n&lt;img src="gambaruku.png"  alt="Gambar" /&gt;&lt;br /&gt; \r\n&lt;/p&gt; \r\n&lt;p&gt; Dengan alternative image, maka gambar akan ditampilkan dengan sebuah teks bertuliskan Gambar..&lt;/p&gt; \r\n&lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<h3>\r\n	Gambar sebagai suatu Link</h3>\r\n<p>\r\n	Pernah gak melihat gambar bertulisan donwload here atau download saja dengan bentuk bulat, persegi, dan lain-lain? Nah kalau sudah pernah, itu adalah penampakan dari gambar sebagai suatu link.Hehe Contohnya:</p>\r\n<p>\r\n	&nbsp;</p>\r\n<pre class="brush:xml">&lt;html&gt; \r\n&lt;body&gt; \r\n&lt;p&gt; &lt;a href="test.html"&gt;&lt;img border="0" src="download-button.gif" /&gt;&lt;/a&gt; &lt;/p&gt; &lt;/body&gt; \r\n&lt;/html&gt;</pre>\r\n<p>\r\n	&nbsp;</p>\r\n', 1, 8, '2013-04-16 02:51:34', 129, '', '2013-04-16 03:10:39', 129, 0, '0000-00-00 00:00:00', '2013-04-16 02:51:34', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 0, '', '', 1, 1, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
