(95, 'Home', '', '<p>\r\n	&nbsp;</p>\r\n<p class="blabox-jck" style="text-align: center;">\r\n	<span style="font-size: 24px;">Selamat</span><span style="font-size: 24px;">&nbsp;Datang Di Web Code Website</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Website</em>&nbsp;ini adalah&nbsp;<em>website</em>&nbsp;yang ditunjukkan untuk belajar&nbsp;<em>programming</em>. Khususnya&nbsp;<em>Web Programming</em>. Kenapa&nbsp;<em>Web</em>&nbsp;Programming? Karena pemograman&nbsp;<em>web</em>&nbsp;untuk sekarang-sekarang ini semakin populer beserta kemajuan teknologi yang begitu cepatnya, selain itu bahasa pemograman&nbsp;<em>web</em>&nbsp;adalah bahasa pemograman yang&nbsp;<em>multi platform</em>&nbsp;atau&nbsp;<em>cross platform,&nbsp;</em>karena bisa berjalan di berbagai Sistem Operasi hanya dengan syarat tersedianya&nbsp;<i>browser web&nbsp;</i>untuk menjalankan pemograman&nbsp;<em>web</em>. Maka dari itu saya ingin ikut serta dalam kemajuan perkembangan dunia&nbsp;<em>programming web</em>&nbsp;ini.</p>\r\n<p>\r\n	Kita sebagai masyarakat Indonesia, khususnya yang berkecimpung di dinua TI (Teknik Informatika) tidak boleh tertinggal dengan kemajuan teknologi yang begitu pesat sekarang ini. Kita lihat saja sekarang ini sudah hal umum bagi suatu perusahaan untuk meiliki&nbsp;<em>website,&nbsp;</em>karena begitu pentingnya sekarang ini untuk memiliki website bagi suatu perusahaan, hanya dengan satu domain saja, seluruh masyarakat di dunia bisa mengaksesnya dimanapun dan kapanpun tanpa harus melakukan install-install dahulu. Website adalah suatu media yang bisa dijadikan sebagai alat untuk iklan, bisnis dan lain-lain, bahkan untuk saat ini apabila kita ingin berdiskusi tidak perlu lagi menyiapkan tempat yang luas dan waktu yang sulit untuk mengaturnya, karena sekarang ini sudah banyak forum-forum online yang bisa digunakan untuk berdiskusi dimanapun dan siapapun anda, mudah bukan?</p>\r\n<p>\r\n	Lihat saja beberapa produk website yang sangat populer seperti&nbsp;<a href="http://www.google.com" target="_blank">google.com</a>,&nbsp;<a href="http://www.yahoo.com" target="_blank">yahoo.com</a>,&nbsp;<a href="http://www.facebook.com" target="_blank">facebook.c</a><a href="http://www.facebook.com" target="_blank">o</a><a href="http://www.facebook.com" target="_blank">m</a>, dan masih banyak lagi yang tidak bisa disebutkan satu per satu. Belum lagi kalangan seperti pemerintahan, sekolah dan sejenisnya itu perlu mempunyai sebuah halaman web sebagai media informasi yang perlu masyarakat ketahui dan sebagai alat untuk memberikan masukan-masukan dari masyarakat. Coba bayangkan waktu dimana dulu sebelum adanya web, pasti kita akan kerepotan harus mencari sesuatu dengan membaca buku satu per satu dan mencari artikelnya. Selain itu website juga tidak selamanya baik, banyak juga yang menyalahgunakan website untuk kepentingan pribadi atau golongan dalam tindak kriminal dan kejahatan. Sebut saja banyak anak-anak atau bahkan orang dewasa yang iseng dan jail menghack website seseorang dan merugikan orang itu.&nbsp;<img alt="angry" height="20" src="http://127.0.0.1/CodeWeb/plugins/editors/jckeditor/plugins/smiley/images/angry_smile.gif" title="angry" width="20" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Dan saya (Web Code) akan berupaya untuk menyajikan hal-hal mengenai pemograman (khususnya&nbsp;<em>web programming</em>) dengan pembahasan yang mudah dimengerti dan mudah dipahami. Dan apabila ada kesulitan mengenai tulisan atau artikel yang kami buat, silahkan tinggalkan komentar di form komentar.</p>\r\n<p>\r\n	Semoga&nbsp;<em>website&nbsp;</em>kami ini menjadi sebuah&nbsp;<em>website</em>&nbsp;yang berguna untuk masyarakat umum dan berguna sebagai bahan untuk pembelajaran. Dan semoga&nbsp;<em>website</em>&nbsp;ini menjadi&nbsp;<em>website</em>&nbsp;yang senantiasa memberikan informasi mengenai dunia teknologi informasi yang selalu&nbsp;<em>up to date&nbsp;</em>dan bermanfaat<em>.&nbsp;</em>Amin&nbsp;<img alt="smiley" height="20" src="http://127.0.0.1/CodeWeb/plugins/editors/jckeditor/plugins/smiley/images/regular_smile.gif" title="smiley" width="20" /></p>\r\n', 1, 'position-3', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*');
