(9, 2, '5809749154429913618', '5809749151874927265', 'http://lh3.ggpht.com/-Qxq8hRntX3g/UKBgExfryhI/AAAAAAAAB-o/9R3TauViHE4/s144/architecture%252520blue%252520mary%252520axe%252520britain%252520building.jpg', 'http://lh3.ggpht.com/-Qxq8hRntX3g/UKBgExfryhI/AAAAAAAAB-o/9R3TauViHE4/s144/architecture%252520blue%252520mary%252520axe%252520britain%252520building.jpg', 'http://lh3.ggpht.com/-Qxq8hRntX3g/UKBgExfryhI/AAAAAAAAB-o/9R3TauViHE4/s1024/architecture%252520blue%252520mary%252520axe%252520britain%252520building.jpg', '30 St Mary Axe', '30 St Mary Axe, also known as "the Gherkin", is a skyscraper in London''s financial district completed in December 2003, with height of 180 meters and 41 floors.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749154429913618', 1, 1, 0, '', 'Canon/Canon EOS 5D Mark II, 1/320, f/9.0, 28mm, ISO-100, no flash'),
(10, 2, '5809749155796473266', '5809749151874927265', 'http://lh3.ggpht.com/-6bVhNB6oeQE/UKBgE2lf1bI/AAAAAAAAB-w/elGx_z5LMhc/s144/architecture%252520monument%252520sky%252520building%252520montreal.jpg', 'http://lh3.ggpht.com/-6bVhNB6oeQE/UKBgE2lf1bI/AAAAAAAAB-w/elGx_z5LMhc/s144/architecture%252520monument%252520sky%252520building%252520montreal.jpg', 'http://lh3.ggpht.com/-6bVhNB6oeQE/UKBgE2lf1bI/AAAAAAAAB-w/elGx_z5LMhc/s1024/architecture%252520monument%252520sky%252520building%252520montreal.jpg', '30 St Mary Axe', 'This is a Roman Catholic basilica and national shrine on the west slope of Mount Royal in Montreal, Quebec. It is Canada''s largest church.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749155796473266', 2, 1, 0, '', 'Canon/Canon EOS 5D, 1/800, f/4.0, 17mm, ISO-100, no flash'),
(11, 2, '5809749159985003058', '5809749151874927265', 'http://lh4.ggpht.com/-3c_cuq5v9sA/UKBgFGMHujI/AAAAAAAAB-s/0s0NAPHS3HA/s144/architecture-cathedral-church-city.jpg', 'http://lh4.ggpht.com/-3c_cuq5v9sA/UKBgFGMHujI/AAAAAAAAB-s/0s0NAPHS3HA/s144/architecture-cathedral-church-city.jpg', 'http://lh4.ggpht.com/-3c_cuq5v9sA/UKBgFGMHujI/AAAAAAAAB-s/0s0NAPHS3HA/s1024/architecture-cathedral-church-city.jpg', 'York Minster Cathedral', 'York Minster is a cathedral in York, England. It''s one of the world''s most magnificent cathedrals.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749159985003058', 3, 1, 0, '', 'Canon/Canon EOS 5D Mark II, 1/30, f/11.0, 28mm, ISO-500, no flash'),
(12, 2, '5809749175467659826', '5809749151874927265', 'http://lh6.ggpht.com/-Qen1TiFcviM/UKBgF_3eUjI/AAAAAAAAB-0/zgK5yKVJzdY/s144/bridge%252520sighs%252520cambridge%252520river%252520boat%252520punting%252520people.jpg', 'http://lh6.ggpht.com/-Qen1TiFcviM/UKBgF_3eUjI/AAAAAAAAB-0/zgK5yKVJzdY/s144/bridge%252520sighs%252520cambridge%252520river%252520boat%252520punting%252520people.jpg', 'http://lh6.ggpht.com/-Qen1TiFcviM/UKBgF_3eUjI/AAAAAAAAB-0/zgK5yKVJzdY/s1024/bridge%252520sighs%252520cambridge%252520river%252520boat%252520punting%252520people.jpg', 'Bridge of Sighs', 'The Bridge of Sighs , designed by Henry Hutchinson, is a bridge crosses the River Cam. It''s belong to St John''s College of Cambridge University.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749175467659826', 4, 1, 0, '', 'Panasonic/DMC-FZ50, 1/200, f/5.6, 7mm, ISO-100, no flash'),
(13, 2, '5809749176329649570', '5809749151874927265', 'http://lh4.ggpht.com/-Svm689BuKh8/UKBgGDE_PaI/AAAAAAAAB-8/-1V8W14KXO0/s144/eiffel.jpg', 'http://lh4.ggpht.com/-Svm689BuKh8/UKBgGDE_PaI/AAAAAAAAB-8/-1V8W14KXO0/s144/eiffel.jpg', 'http://lh4.ggpht.com/-Svm689BuKh8/UKBgGDE_PaI/AAAAAAAAB-8/-1V8W14KXO0/s1024/eiffel.jpg', ' Eiffel Tower', 'The Eiffel Tower, located on the Champ de Mars in Paris, is global cultural icon of France and one of the most typical structures in the world.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749176329649570', 5, 1, 0, '', 'EASTMAN KODAK COMPANY/KODAK EASYSHARE Z710 ZOOM DIGITAL CAMERA, 1/320, f/4.0, 6mm, ISO-64'),
(14, 2, '5809749182060786210', '5809749151874927265', 'http://lh3.ggpht.com/-4v4oPoHthPs/UKBgGYbZciI/AAAAAAAAB_A/XKcKteruBCU/s144/enormous%252520gate%252520columnar%252520walhalla.jpg', 'http://lh3.ggpht.com/-4v4oPoHthPs/UKBgGYbZciI/AAAAAAAAB_A/XKcKteruBCU/s144/enormous%252520gate%252520columnar%252520walhalla.jpg', 'http://lh3.ggpht.com/-4v4oPoHthPs/UKBgGYbZciI/AAAAAAAAB_A/XKcKteruBCU/s1024/enormous%252520gate%252520columnar%252520walhalla.jpg', 'Enormous GateColumnar Walhalla', 'The Walhalla is a hall of fame that honors famous people in German history The hall is housed in a neo-classical building above the Danube River, Germany.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749182060786210', 6, 1, 0, '', 'Panasonic/DMC-FZ18, 1/200, f/4.0, 4mm, ISO-100, no flash'),
(15, 2, '5809749190437834146', '5809749151874927265', 'http://lh5.ggpht.com/-u1cDs-M-0_A/UKBgG3opDaI/AAAAAAAAB_U/g7vkQPUlHzo/s144/reichstag%252520berlin%252520cupola%252520glass%252520building%252520glass%252520dome.jpg', 'http://lh5.ggpht.com/-u1cDs-M-0_A/UKBgG3opDaI/AAAAAAAAB_U/g7vkQPUlHzo/s144/reichstag%252520berlin%252520cupola%252520glass%252520building%252520glass%252520dome.jpg', 'http://lh5.ggpht.com/-u1cDs-M-0_A/UKBgG3opDaI/AAAAAAAAB_U/g7vkQPUlHzo/s1024/reichstag%252520berlin%252520cupola%252520glass%252520building%252520glass%252520dome.jpg', 'The Reichstag Dome', 'The Reichstag dome designed by architect Norman Foster is a glass dome constructed on top of the rebuilt Reichstag building in Berlin.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749190437834146', 7, 1, 0, '', 'SONY/DSC-P200, 1/60, f/2.8, 7mm, ISO-100, no flash'),
(16, 2, '5809749198003611618', '5809749151874927265', 'http://lh3.ggpht.com/-CmjR7J0mgis/UKBgHT0dp-I/AAAAAAAAB_Q/Ylsh5gjiKZo/s144/westminster.jpg', 'http://lh3.ggpht.com/-CmjR7J0mgis/UKBgHT0dp-I/AAAAAAAAB_Q/Ylsh5gjiKZo/s144/westminster.jpg', 'http://lh3.ggpht.com/-CmjR7J0mgis/UKBgHT0dp-I/AAAAAAAAB_Q/Ylsh5gjiKZo/s1024/westminster.jpg', 'Westminster Abbey Church', 'Westminster Abbey is a large Gothic church in London, United Kingdom. This is the place where British royal weddings, coronation and burial site are taken place.', 'https://picasaweb.google.com/101560173596944116173/JSNImageShowSampleImagesArchitecture#5809749198003611618', 8, 1, 0, '', 'Canon/Canon EOS 5D Mark II, 1/80, f/2.0, 24mm, ISO-100, no flash'),
(17, 1, '5797131416944122066', '5540425893564885185', 'http://lh5.ggpht.com/-WdHY5cr6ams/UHOMTyc2GNI/AAAAAAAABz4/srgDH_v5w_I/s144/1.jpg', 'http://lh5.ggpht.com/-WdHY5cr6ams/UHOMTyc2GNI/AAAAAAAABz4/srgDH_v5w_I/s144/1.jpg', 'http://lh5.ggpht.com/-WdHY5cr6ams/UHOMTyc2GNI/AAAAAAAABz4/srgDH_v5w_I/s1024/1.jpg', 'Beautiful Design', 'JSN Epic has incredibly beautiful clean design with ultra flexible layout built-up from 36 module positions.', 'index.php?option=com_content&view=article&id=21&Itemid=199', 1, 1, 0, '', ''),
(18, 1, '5797131418408471074', '5540425893564885185', 'http://lh5.ggpht.com/-ilHK94smi9I/UHOMT35-SiI/AAAAAAAABz0/vkZCcDIZ9wY/s144/2.jpg', 'http://lh5.ggpht.com/-ilHK94smi9I/UHOMT35-SiI/AAAAAAAABz0/vkZCcDIZ9wY/s144/2.jpg', 'http://lh5.ggpht.com/-ilHK94smi9I/UHOMT35-SiI/AAAAAAAABz0/vkZCcDIZ9wY/s1024/2.jpg', 'Stable Feature Rich Core', 'For us, JSN Epic is not just a template, but whole piece of software for which we spent more then 2 years.', 'index.php?option=com_content&view=article&id=21&Itemid=199', 2, 1, 0, '', ''),
(19, 1, '5797131419417121090', '5540425893564885185', 'http://lh4.ggpht.com/-_mx6QzhEuEs/UHOMT7qdEUI/AAAAAAAABz8/4-ZLhAJqzSg/s144/3.jpg', 'http://lh4.ggpht.com/-_mx6QzhEuEs/UHOMT7qdEUI/AAAAAAAABz8/4-ZLhAJqzSg/s144/3.jpg', 'http://lh4.ggpht.com/-_mx6QzhEuEs/UHOMT7qdEUI/AAAAAAAABz8/4-ZLhAJqzSg/s1024/3.jpg', 'Dead-easy Configuration', 'You will be surprised how such a capable template can be so easily handled. Majority of template features are conveniently managed by template parameters.', 'index.php?option=com_content&view=article&id=21&Itemid=199', 3, 1, 0, '', ''),
(20, 1, '5797131428405016930', '5540425893564885185', 'http://lh6.ggpht.com/-EKJeIxo2V9I/UHOMUdJVeWI/AAAAAAAAB0A/TSiWA2RSZEM/s144/4.jpg', 'http://lh6.ggpht.com/-EKJeIxo2V9I/UHOMUdJVeWI/AAAAAAAAB0A/TSiWA2RSZEM/s144/4.jpg', 'http://lh6.ggpht.com/-EKJeIxo2V9I/UHOMUdJVeWI/AAAAAAAAB0A/TSiWA2RSZEM/s1024/4.jpg', 'Outstanding Docs & Support', 'Even when the template is deadly easy to use, we still provide very comprehensive documentation package of video and PDF documents.', 'index.php?option=com_content&view=article&id=21&Itemid=199', 4, 1, 0, '', ''),
(21, 1, '5797131429197820178', '5540425893564885185', 'http://lh4.ggpht.com/-3n-fJu8X2OQ/UHOMUgGWsRI/AAAAAAAAB0E/CBxPs6z1Lno/s144/5.jpg', 'http://lh4.ggpht.com/-3n-fJu8X2OQ/UHOMUgGWsRI/AAAAAAAAB0E/CBxPs6z1Lno/s144/5.jpg', 'http://lh4.ggpht.com/-3n-fJu8X2OQ/UHOMUgGWsRI/AAAAAAAAB0E/CBxPs6z1Lno/s1024/5.jpg', 'Cost Effective Solution', 'All the benefits is available for you for free. Our ultimate goal is to offer you a solution that in turns must bring you much more profit.', 'index.php?option=com_content&view=article&id=21&Itemid=199', 5, 1, 0, '', '');
