INSERT INTO `artikel` (`no`, `judul`, `isi`, `tanggal`) VALUES
(1, 'Selamat datang di Website Universitas Pamulang', 'Upaya peningkatan angka partisipasi mahasiswa tersebut juga dibarengi dengan pengembangan sejumlah program studi, yang semula hanya terdiri dari 5 program studi kini telah berkembang menjadi 13 program studi, yang terdiri dari 11 program studi jenjang S.1 dan 2 program studi jenjang D.3, yang 8 diantaranya telah diakreditasi oleh Badan Akreditasi Nasional Perguruan Tinggi (BAN-PT). Begitu pula dengan tenaga dosen, saat ini Universitas Pamulang telah didukung oleh 171 tenaga dosen yang sebagian besar berlatar belakang pendidikan S.2 dan S.3, baik lulusan dari dalam maupun luar negeri, yang telah memenuhi kualifikasi sebagai tenaga dosen. Selanjutnya, dalam kerangka pengembangan institusi kedepan, kerjasama dengan pihak ketiga juga telah mulai dirintis, diantaranya kerjasama dengan Kementrian Riset dan Tekhnologi dalam penelitian pembuatan bahan bakar roket yang murah dan tidak berbahaya, dengan Direktorat Jenderal Perguruan Tinggi, Kopertis Wilayah IV, maupun dengan Baca', '2013-03-29'),
(3, 'SAMBUAT REKTOR UNIVERSITAS PAMULANG', 'Assalamualaikum Wr.Wb.Salam sejahtera. Selamat datang di website universitas pamulang Inilah media komunikasi kami untuk masyarakat umum. Seiring dengan upaya penataan dan peningkatan mutu layanan melalui alih manajemen pada tahun 2004, jumlah mahasiswa Universitas Pamulang sekarang hampir mendekati 5500 mahasiswa', '2013-03-29');
