INSERT INTO `VIEWS` (`TABLE_CATALOG`, `TABLE_SCHEMA`, `TABLE_NAME`, `VIEW_DEFINITION`, `CHECK_OPTION`, `IS_UPDATABLE`, `DEFINER`, `SECURITY_TYPE`, `CHARACTER_SET_CLIENT`, `COLLATION_CONNECTION`) VALUES
('def', 'pembayaransiswa', 'transaksi', 'select distinct `B`.`no_induk` AS `no_induk`,`B`.`nama_siswa` AS `nama_siswa`,`A`.`kelas` AS `kelas`,`A`.`jumlah` AS `jumlah`,`A`.`biaya_perbulan` AS `biaya_perbulan`,sum(`C`.`dibayar`) AS `pemasukan`,(`A`.`jumlah` - sum(`C`.`dibayar`)) AS `tunggakan`,group_concat(`C`.`bulan` separator '','') AS `bulan` from `pembayaransiswa`.`siswa` `B` join `pembayaransiswa`.`spp` `A` join `pembayaransiswa`.`transaksi_spp` `C` where ((`A`.`kelas` = `B`.`kelas`) and (`B`.`no_induk` = `C`.`no_induk`)) group by `B`.`no_induk` order by `B`.`no_induk`,`C`.`bulan`', 'NONE', 'NO', 'root@localhost', 'DEFINER', 'utf8', 'utf8_general_ci');
