(318, '_transient_feed_867bd5c64f85878d03a060509cd2f92c', 'a:4:{s:5:"child";a:1:{s:0:"";a:1:{s:3:"rss";a:1:{i:0;a:6:{s:4:"data";s:3:"\n\n\n";s:7:"attribs";a:1:{s:0:"";a:1:{s:7:"version";s:3:"2.0";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:1:{s:7:"channel";a:1:{i:0;a:6:{s:4:"data";s:61:"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:16:"WordPress Planet";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:28:"http://planet.wordpress.org/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"language";a:1:{i:0;a:5:{s:4:"data";s:2:"en";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:47:"WordPress Planet - http://planet.wordpress.org/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"item";a:50:{i:0;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:63:"Mark Jaquith: WordPress 3.6: shortcode_atts_{$shortcode} filter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:40:"http://markjaquith.wordpress.com/?p=3975";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://markjaquith.wordpress.com/2013/04/04/wordpress-36-shortcode-attribute-filter/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2282:"<p>Since WordPress 3.6 is in beta, I thought I&#8217;d use this nearly-abandoned blog (hey, been busy working on WordPress!) to talk about some of the cool stuff for developers. For the first installment, check out the new <code>shortcode_atts_{$shortcode}</code> filter. The <code>shortcode_atts()</code> function now accepts a third parameter  the name of the shortcode  which enables the running of this filter. All of the core shortcodes now pass this parameter.</p>\n<p>This filter passes three things:</p>\n<ol>\n<li><code>$out</code>  the output array of shortcode attributes</li>\n<li><code>$pairs</code>  the array of accepted parameters and their defaults.</li>\n<li><code>$atts</code>  the input array of shortcode attributes</li>\n</ol>\n<p>Let&#8217;s look at what we can do with this. One thing is that you can dynamically set or override shortcode values. You an also define new ones, and transpose them into accepted ones. Let&#8217;s look at the &#8220;gallery&#8221; shortcode for example. What if there was a gallery of images that you would reuse. Instead of picking the images each time, you could have a plugin that gives that set of attachment IDs a shortcut name. Then you could do <code>[gallery foo=my-gallery-name]</code>, which the plugin would convert to a list of IDs. Or, you could enforce a certain number of gallery columns on the fly. Let someone set it theme-wide, without having them go back and change their shortcodes.</p>\n<p>What other uses can you think of?</p>\n<p>Now, if you&#8217;re a plugin or theme author who provides their own shortcodes, you should immediately start providing this third parameter to your <code>shortcode_atts()</code> calls (since it is an extra parameter, you can do this without a WordPress version check). Maybe it&#8217;ll reduce the number of times people need to fork your code just to add an option to your shortcode!</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/markjaquith.wordpress.com/3975/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/markjaquith.wordpress.com/3975/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=markjaquith.wordpress.com&blog=316&post=3975&subd=markjaquith&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 05 Apr 2013 03:12:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Mark Jaquith";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:30:"Dev Blog: WordPress 3.6 Beta 1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2547";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:55:"http://wordpress.org/news/2013/04/wordpress-3-6-beta-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4076:"<p>WordPress 3.6 Beta 1 is now available!</p>\n<p>This is software still in development and<strong>we <em>really</em>dont recommend that you run it on a production site</strong> set up a test site just to play with the new version.To test WordPress 3.6, try the<a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester</a>plugin (youll want bleeding edge nightlies). Or you can<a href="http://wordpress.org/wordpress-3.6-beta1.zip">download the beta here</a>(zip).</p>\n<p>We&#8217;ve been working for nearly three months and have completed all the features that are slated for this release.This is a bit of a change from the betas of previous release cycles. I felt very strongly that we shouldn&#8217;t release a beta if we were still working on completing the main features. This beta is <strong>actually a beta</strong>, not an alpha that we&#8217;re calling a beta. If you are a WordPress plugin or theme developer, or a WordPress hosting provider, you should absolutely start testing your code against this new version <strong>now</strong>. More bugs will be fixed, and some of the features will get polished, but we&#8217;re not going to shove in some big new feature. We&#8217;re ready for you to test it, so jump in there! The more you test the beta, the more stable our release candidates and our final release will be.</p>\n<p>As always, if you think youve found a bug, you can post to the<a href="http://wordpress.org/support/forum/alphabeta">Alpha/Beta area</a>in the support forums. Or, if youre comfortable writing a reproducible bug report,<a href="http://core.trac.wordpress.org/">file one on the WordPress Trac</a>. There, you can also find<a href="http://core.trac.wordpress.org/report/5">a list of known bugs</a>and<a href="http://core.trac.wordpress.org/query?status=closed&group=component&milestone=3.6">everything we&#8217;ve fixed</a>so far.</p>\n<p>Here&#8217;s what&#8217;s new in 3.6:</p>\n<ul>\n<li><strong>Post Formats:</strong> Post Formats now have their own UI, and theme authors have access to templating functions to access the structured data.</li>\n<li><strong>Twenty Thirteen:</strong> We&#8217;re shipping this year&#8217;s default theme in our first release of the year. Twenty Thirteen is an opinionated, color-rich, blog-centric theme that makes full use of the new Post Formats support.</li>\n<li><strong>Audio/Video:</strong> You can embed audio and video files into your posts without relying on a plugin or a third party media hosting service.</li>\n<li><strong>Autosave:</strong> Posts are now autosaved locally. If your browser crashes, your computer dies, or the server goes offline as you&#8217;re saving, you won&#8217;t lose the your post.</li>\n<li><strong>Post Locking:</strong> See when someone is currently editing a post, and kick them out of it if they fall asleep at the keyboard.</li>\n<li><strong>Nav Menus:</strong> Nav menus have been simplified with an accordion-based UI, and a separate tab for  bulk-assigning menus to locations.</li>\n<li><strong>Revisions:</strong> The all-new revisions UI features avatars, a slider that &#8220;scrubs&#8221; through history, and two-slider range comparisons.</li>\n</ul>\n<p><strong>Developers:</strong> You make WordPress awesome(er). One of the things we strive to do with every release is be compatible with existing plugins and themes. But we need your help. <strong>Please test your plugins and themes against 3.6.</strong> If something isn&#8217;t quite right, please let us know. (Chances are, it wasn&#8217;t intentional.) If you&#8217;re a forward-thinking theme developer, you should be looking at implementing the new Post Format support in some of your themes (look to Twenty Thirteen for inspiration).</p>\n<p>We&#8217;re looking forward to your feedback.If you break it (i.e. find a bug), please report it, and if youre a developer, try to help us fix it.We&#8217;ve already had more than 150 contributors to version 3.6  it&#8217;s not too late to join the party!</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 04 Apr 2013 17:25:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Mark Jaquith";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:35:"Dougal Campbell: CodePoet Interview";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:34:"http://dougal.gunters.org/?p=72513";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:77:"http://dougal.gunters.org/blog/2013/04/04/dougal-campbell-codepoet-interview/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1589:"<div class="featured-image align-right"><img width="164" height="52" src="http://geekramblings.gunters.netdna-cdn.com/wordpress/wp-content/uploads/2013/04/codepoet-logo.png?9bb111" class="attachment-post-thumbnail wp-post-image" alt="CodePoet Logo" /></div><!--\narticle.tag-codepoet div.featured-image img{background-color: #333;}\n-->\n<p>I was honored to be chosen for an <a title="It''s me!" href="http://build.codepoet.com/2013/04/04/dougal-campbell-interview/">interview on CodePoet</a>. Though I haven&#8217;t been able to stay as involved with WordPress as much lately as I&#8217;d like, due to job and family, I guess I&#8217;m of &#8220;historical interest&#8221; because of my involvement as a core developer back in the first couple of years. (I jest &#8212; a little)</p>\n<p>We discuss how I came to web development and from there to WordPress, my more recent activity as a speaker at WordCamp Atlanta on the topic of security, the community and why someone should become involved, and the differences between web development as a job versus as a hobby, among other things.</p>\n<p>I enjoyed answering the questions, and I hope you all will enjoy reading the interview!</p>\n<p>&nbsp;</p>\n<p>Original Article: <a href="http://dougal.gunters.org/blog/2013/04/04/dougal-campbell-codepoet-interview/">CodePoet Interview</a>\n<a href="http://dougal.gunters.org">Dougal Campbell&#039;s geek ramblings - WordPress, web development, and world domination.</a></p><div class="yarpp-related-rss yarpp-related-none">\n<img src="http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130" />\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 04 Apr 2013 16:03:51 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Dougal Campbell";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:54:"Gravatar: Gravatar and WordPress.com, Together Forever";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://blog.gravatar.com/?p=437";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:80:"http://blog.gravatar.com/2013/04/03/gravatar-and-wordpress-com-together-forever/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3493:"<p>Did you know that your Gravatar.com account has always been a WordPress.com account? It&#8217;s true.</p>\n<p>Back in 2007 we (<a href="http://automattic.com">Automattic</a>) acquired Gravatar. Heading into 2008 we <a href="http://blog.gravatar.com/2008/03/14/big-changes-afoot/">rewrote it in PHP</a>, and ever since then, it&#8217;s been using the same integrated user system as WordPress.com for accounts. Previously we handled that &#8220;behind the scenes,&#8221; but we found that it made things pretty confusing for everyone. We&#8217;ve now switched over to using <a href="http://en.support.wordpress.com/wpcc-faq/">WordPress.com Connect</a>exclusively, which allows you to explicitly connect Gravatar and WordPress.com, and to use your WordPress.com credentials to log into Gravatar. That&#8217;s one less set of login credentials to worry about!</p>\n<div id="attachment_438" class="wp-caption aligncenter"><img class="size-full wp-image-438" alt="wpcc-button" src="http://gravatar.files.wordpress.com/2013/04/wpcc-button.png?w=258&h=65" width="258" height="65" /><p class="wp-caption-text">This is not a real button <img src="http://s0.wp.com/wp-includes/images/smilies/icon_smile.gif" alt=":)" class="wp-smiley" /></p></div>\n<ol>\n<li><span>If you had a Gravatar account before, it&#8217;s actually always been a WordPress.com account!</span></li>\n<li>When you try to log in at Gravatar.com now, you will be asked to do so using WordPress.com Connect.</li>\n<li>Once you&#8217;re logged into WordPress.com, you then grant Gravatar access to use your WordPress.com account.</li>\n<li>After that, you&#8217;ll use your WordPress.com username and password to log in to Gravatar, for evermore.</li>\n</ol>\n<p>You might be wondering about existing accounts and creating new accounts, and what your options are:</p>\n<ul>\n<li><span>If you have a Gravatar account, it&#8217;s actually also a WordPress.com account. You can use those details to log into WordPress.com, then grant access to Gravatar.</span></li>\n<li>If you already have a WordPress.com account, then you can use that to log into Gravatar.com now.</li>\n<li>If you don&#8217;t have a WordPress.com (or Gravatar) account, you can create one for free (no need for a blog, although you can do that also if you like!) and then you can grant access to Gravatar to get started.</li>\n</ul>\n<p>The beauty of switching to WordPress.com Connect is that it means your account information is all managed in one, super-secure place (WordPress.com), and it avoids all sorts of complexity and potential for problems with password resets, account activations, and more. We&#8217;re in the process of switching all of our services to using WordPress.com Connect, so you can use the same account to log into our other nifty products, including <a href="http://vaultpress.com">VaultPress</a>, <a href="http://akismet.com">Akismet</a> and <a href="http://polldaddy.com">Polldaddy</a>.</p>\n<p>There&#8217;s a bunch more info on the <a href="http://en.support.wordpress.com/wpcc-faq/">WordPress.com Connect FAQ</a>,which will hopefully help clear up any other questions you have.</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/gravatar.wordpress.com/437/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/gravatar.wordpress.com/437/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=blog.gravatar.com&blog=1886259&post=437&subd=gravatar&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 03 Apr 2013 18:33:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Beau Lebens";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:61:"WordPress.tv: Understanding the WordPress Add New U