ss.tv/?p=18452";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:72:"http://wordpress.tv/2013/03/28/phil-erb-wordpress-is-installed-now-what/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:674:"<div id="v-f6li6sy6-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/18452/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/18452/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=18452&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2013/03/28/phil-erb-wordpress-is-installed-now-what/"><img alt="Phil Erb: WordPress is Installed&#8230; Now What?" src="http://videos.videopress.com/f6li6sy6/video-50494d19a5_scruberthumbnail_0.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 01 Apr 2013 04:30:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"WordPress.tv";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:100:"Weblog Tools Collection: I am taking my leave of Weblog Tools Collection, and thanks for everything!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12845";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/NRKA8GMV-fA/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4720:"<p>Not many of the present readers might know me very well, and that in part, is the reason that I have made the decision to transfer WLTC to more willing and presently capable hands. I am a stranger on my blog and the time has come for me to make sure that this blog, its contents and its knowledge are archivedand preserved and maybe rejuvenated at a later time.</p>\n<p>Idelvedinto blogging tools back in 2004 when I started my Masters degree in CS. I wanted some code to mess around with in my free time and everyone was talking about blogging. I looked into a variety of tools, built a small Linux server for myself at home, and installed a few of the tools that were freely available at that time. I had a heck of a time getting a hold of MT (Moveable Type, the most well-known name) and then found b2 by sheer luck. I loved the cool look of Michael&#8217;s blog and the people involved in the tool seemed to be open to comments and replied warmly to my emails and questions. Through the b2 forums I heard about WordPress and proceeded to install it on my own. To my astonishment, it worked without a hitch and I was blogging away in no time. I started looking through the code to understand how it worked and it drew me in every step of the way.</p>\n<p>Within a few months of installing WordPress, I started to take part in the forums and wrote a few plugins and created some &#8220;hacks&#8221; for the tool. I even gained some notoriety with my MT VS WP post and that&#8217;s when the WordPress ecosphere started to look very attractive to me. I did not do this to seek attention, but I was getting a lot of attention and I was loving it. I believe that was when Matt first noticed me and we exchanged some emails and chatted with each other. With every month and with every release of WordPress I was getting more involved. At some point I realized that I could not do it alone and hired a few interested people to help me write posts and the blog started to get popular. I brought on some advertisers to help me offset costs. Matt gave me and my blog the highest honor of being included in the WordPress Planet and that&#8217;s when things really started to happen for this blog. I also started a WordPress Job blog (http://jobs.wordpress.net) which I still curate and I got involved in WordPress evangelism.Somewhere within this time, Matt had asked me to work for him at the new company he was starting and I had to turn him down because of visa restrictions and because I wanted to finish school (I kick myself every time I think about that).</p>\n<p>WordPress started to mature and WordCamps started to happen. I graduated from school with a Master&#8217;s Degree in Computer Science and found a job.I wanted to stay involved but it was getting bigger than I could handle. I could either dive in and get into WordPress and the blogging world, or I could focus on my job, career and family. I decided to choose the latter. I still wanted to loosely be involved with WordPress and things went well for a couple of years with me being casually involved. I even visited and spoke at a couple of WordCamps.</p>\n<p>When my son Lucien was born, all my time and attention was exhausted on him. I could not spend any time with WordPress or blogging at all. In addition to my growing family, I was diagnosed with a serious health condition just as I was starting a new job and moving to a new city. Needless to say, the blog was the last thing on my mind. James, who has been the sole author and curator for a long time, was my winning hand and just a fantastic helper and well wisher. He has kept things running for a long time and I have had no complaints.</p>\n<p>But I have found very little time to come back and spend with my old friends, Weblog Tools Collection and WordPress. I do not want this blog&#8217;s content and conversations to be lost or forgotten because of my neglect. I am hoping this move will help it live on as an archive, or find new lifeblood in another form. I know that it is in the right hands.</p>\n<p>So Adios and Gracias. I hope to see you in another blog, and take part in another conversation with you someday. It has been a wonderful journey and I appreciate everything that has taken place because of WordPress and every bit of help and encouragement that has been provided to me by so many of you. So thank to my wonderful audience of many years, thanks to my advertisers, thanks to my authors and finally thanks to Matt and to WordPress for making my life so much more fulfilling and successful.</p>\n<p>Peace on Earth, Goodwill to All, And to All a Goodnight!</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/NRKA8GMV-fA" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 31 Mar 2013 13:41:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Mark Ghosh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:53:"Weblog Tools Collection: Where to Find WordPress News";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12846";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/ah3QRPNnlhs/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2837:"<p>The landscape of news has changed so much over the last few years that news about a particular topic or platform is readily available to anyone within an instant. With <a href="http://wordpress.org">WordPress</a>, I imagine that could be one of the perks of <a href="http://weblogtoolscollection.com/archives/2012/08/08/the-state-of-the-word-in-2012/">powering over 16% of the web</a>, but it&#8217;s true that news is becoming incredibly accessible. In short, news is everywhere.</p>\n<p>Speaking of WordPress in general, you can of course acquire official direct news from <a href="http://wordpress.org/news/">WordPress News</a>, but you can alsotake a peak behind the curtain and follow news in the making at<a href="http://make.wordpress.org">Make WordPress.org</a>. Though it&#8217;s only specific to the <a href="http://wordpress.com">WordPress.com</a> blogging platform, <a href="http://en.blog.wordpress.com">WordPress.com News</a> is also worth watching for WordPress development news, as WordPress.com users often get access to new WordPress features before they&#8217;re released, so you&#8217;ll be able to try new features rather than just read about them.</p>\n<p>There&#8217;s more news than just direct official news, like I said earlier, it&#8217;s everywhere. You could subscribe to every general news site, every core developer&#8217;s personal blog, every premium theme shop, and every plugin developer, but why not subscribe to a few curated news sources instead? I guess you could call <a href="http://planet.wordpress.org">WordPress Planet</a>the official curated news source, but it&#8217;s really just a collection of all news items from a particular set of curated blogs. For specific news items curated from sources through the entire WordPress community, subscribe to <a href="http://poststat.us">Post Status</a>, and don&#8217;t neglect the power of allowing the folks you follow on <a href="http://twitter.com">Twitter</a>, <a href="http://plus.google.com">Google+</a>, and/or <a href="http://www.facebook.com">Facebook</a> to curate news for you.</p>\n<p>Speaking of the WordPress community, you should <a href="http://codex.wordpress.org/Contributing_to_WordPress">get involved</a> if you aren&#8217;t already. If you don&#8217;t even use WordPress yet, it&#8217;s time to get started <a href="http://codex.wordpress.org/Getting_Started_with_WordPress">with either WordPress.org</a> or <a href="http://learn.wordpress.com/get-started/">with WordPress.com</a>, share your thoughts with the world, and maybe spread some WordPress news on your blog too.</p>\n<p>The news is out there, and it&#8217;s well within your reach. If you can&#8217;t find the news, it&#8217;s time to make your own.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/ah3QRPNnlhs" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 31 Mar 2013 00:05:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 3/30";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12837";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/-vmyakR-BnA/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1089:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/gc-message-box/"><strong>GC Message Box</strong></a> allows you to highlight your key message(s) in smart ways within articles and blog posts.</p>\n<p><a href="http://wordpress.org/extend/plugins/simple-social-icons/"><strong>Simple Social Icons</strong></a> allows you to insert social icons in any widget area.</p>\n<p><a href="http://askwebexpert.com/stick-it/"><strong>Stick It</strong></a> allows you to stick the navigation menu in any theme to the top of browser window.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://jetpack.me/"><strong>Jetpack</strong></a> allows you to supercharge your WordPress site with powerful features previously only available to <a href="http://wordpress.com/">WordPress.com</a> users.</p>\n<p><a href="http://blog.milandinic.com/wordpress/plugins/nav-menu-images/"><strong>Nav Menu Images</strong></a> enables uploading of images for nav menu items on the menu edit screen.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/-vmyakR-BnA" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 30 Mar 2013 14:00:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"Matt: (Un)organized Consumption";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42334";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:45:"http://ma.tt/2013/03/unorganized-consumption/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:387:"<p><a href="http://writingthroughthefog.com/2013/03/09/on-unorganized-consumption/">On (Un)organized Consumption</a> by Automattician Cheri Lucas. &#8220;I stopped using Instapaper. Early on, I relied on it as a space to store ideas and information I could draw from, but it quickly became my intellectual limbo: the unfortunate vault of forgotten stories and Twitter residue.&#8221;</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 29 Mar 2013 14:20:19 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:32:"Matt: Evolution of San Francisco";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42333";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:48:"http://ma.tt/2013/03/evolution-of-san-francisco/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2968:"<p>There have been three excellent writings on the effects and consequences of the latest boom on the Bay Area, each long but worth reading.</p>\n<p>The East Bay Express, with a permalink I&#8217;m sure won&#8217;t work a decade from now, brings us <a href="http://www.eastbayexpress.com/oakland/the-bacon-wrapped-economy/Content?oid=3494301&showFullText=true">The Bacon-Wrapped Economy</a>:</p>\n<div class="blockquote">\n<blockquote>The arts economy, already unstable, has been forced to contend with the twin challenges of changing tastes and new funding models. Entire industries that didn&#8217;t exist ten years ago are either thriving on venture capital, or thriving on companies that are thriving on it. It is now possible to find a $6 bottle of Miller High Life, a $48 plate of fried chicken, or a $20 BLT in parts of the city that used to be known for their dive bars and taco stands. If, after all, money has always been a means of effecting the world we want to bring about, when a region is flooded with uncommonly rich and uncommonly young people, that world begins to look very different. And we&#8217;re all living in it, whether we like it or not.</p></blockquote>\n</div>\n<p>SFGate has <a href="http://www.sfgate.com/technology/dotcommentary/article/Innovation-and-the-face-of-capitalism-4342160.php">The hypocrisy in Silicon Valley&#8217;s big talk on innovation</a>:</p>\n<div class="blockquote">\n<blockquote>&#8220;[I]nnovation&#8221; is something of a magic word around here, shape-shifting to fit the speaker&#8217;s immediate needs. So long as semiconductors and coding are involved, people will staple it to anything from flying cars to the iFart app.</p>\n<p>Other times it&#8217;s just code for &#8220;jobs,&#8221; used to justify asking for government favors one day and scolding them for meddling in the free market the next.</p>\n<p>&#8220;Lower our payroll taxes because &#8230; innovation.&#8221;<br />\n&#8220;Drop that antitrust inquiry because &#8230; innovation.&#8221;</p>\n<p>But for all the funding announcements, product launches, media attention and wealth creation, most of Silicon Valley doesn&#8217;t concern itself with aiming &#8220;almost ridiculously high.&#8221; It concerns itself primarily with getting people to click on ads or buy slightly better gadgets than the ones they got last year.</p></blockquote>\n</div>\n<p>The final comes from Rebecca Solnit, <a href="http://ma.tt/2011/07/on-blue/">who I&#8217;ve quoted before</a>, writes <a href="http://www.lrb.co.uk/v35/n03/rebecca-solnit/diary">a diary for the London Review of Books</a>.</p>\n<div class="blockquote">\n<blockquote>I weathered the dot-com boom of the late 1990s as an observer, but I sold my apartment to a Google engineer last year and ventured out into both the rental market (for the short term) and home buying market (for the long term) with confidence that my long standing in this city and respectable finances would open a path.</p></blockquote>\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 28 Mar 2013 15:49:52 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5