6&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2013/03/25/understanding-wordpress-permalinks/"><img alt="permalinks.mp4" src="http://videos.videopress.com/kEYdKErG/video-f10e063f57_scruberthumbnail_1.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 25 Mar 2013 20:02:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"WordPress.tv";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:20;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:66:"WP iPhone: Version 3.5 is Here: Draft Previews, Autosave, and More";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"http://ios.wordpress.org/?p=1376";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:89:"http://ios.wordpress.org/2013/02/22/version-3-5-is-here-draft-previews-autosave-and-more/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3713:"<p><a href="http://wpiphone.files.wordpress.com/2013/02/wpios-3-5-draft-previews-plus-autosave.png"><img src="http://wpiphone.files.wordpress.com/2013/02/wpios-3-5-draft-previews-plus-autosave.png?w=240&h=517" alt="Version 3.5 of WordPress for iOS: Draft Previews + Autosave" width="240" height="517" class="alignright size-medium wp-image-1402" /></a>We&#8217;re pleased as punch to announce that WordPress for iOS 3.5 is now available in the <a href="https://itunes.apple.com/us/app/wordpress/id335703880?ls=1&mt=8">App Store</a>. The dev team focused on the content editor for this release, which adds some very handy new features:</p>\n<h3>Draft previews</h3>\n<p>We know that publishing your very best stuff is important, and you should be able to see what your post or page will look like <em>before</em> you publish. Now, in version 3.5 of WordPress for iOS, you can preview your drafts! Just tap the preview &#8220;eye&#8221; tab while drafting your post or page to see the post as it will appear on your WordPress site after you hit publish.</p>\n<p>If you have a <a href="http://en.wikipedia.org/wiki/Responsive_web_design">responsive</a> WordPress theme the preview will show what your post looks like on a mobile device.</p>\n<h3>Autosave</h3>\n<p>Thanks to a new Autosave feature, your site&#8217;s content is safer than ever before. Now, when you edit a draft in the app, you&#8217;ll notice a small &#8220;Autosaved &#8221; message appear as you type. The draft is instantly saved locally, and if you have a reliable Internet connection at the time, it will autosave online to your WordPress site, too.</p>\n<p><img src="http://wpiphone.files.wordpress.com/2013/02/wpios-3-5-autosave1.jpg?w=420&h=188" alt="Version 3.5 of WordPress for iOS: Autosave" width="420" height="188" class="aligncenter size-full wp-image-1395" /></p>\n<h3>More improvements and bug fixes</h3>\n<p>This release also includes improvements for WordPress.com and Jetpack notifications, as well as fixes for crashes and other bugs. You can check out all the changes <a href="http://ios.trac.wordpress.org/timeline?from=02%2F11%2F13&daysback=6&authors=&ticket=on&milestone=on&changeset=on&wiki=on&update=Update">here</a>.</p>\n<p>The crash on launch that some of you were seeing has been fixed in this release.</p>\n<h3>What&#8217;s next?</h3>\n<p>We want to continue making your mobile blogging experience better and better! While the dev team is currently deciding what to work on for version 3.6, these next items are high on our list:</p>\n<ul>\n<li>Rich Text Editor</li>\n<li>Improved media management</li>\n<li>Sharing to the app from third-party apps and services</li>\n</ul>\n<p>Want to keep up with the latest happenings in the WordPress mobile world? Head over to<a href="http://make.wordpress.org/mobile">http://make.wordpress.org/mobile</a>.</p>\n<p>A huge thanks to the contributors that worked on this release: <a href="http://wordpress.org/support/profile/beaucollins">beaucollins</a>, <a href="http://wordpress.org/support/profile/daniloercoli">daniloercoli</a>, <a href="http://wordpress.org/support/profile/koke">koke</a>, and <a href="http://wordpress.org/support/profile/mrroundhill">mrroundhill.</a></p>\n<p>If you have any feedback about the app, please leave a comment below or follow us <a href="http://twitter.com/wordpressios">@WordPressiOS</a>.</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wpiphone.wordpress.com/1376/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wpiphone.wordpress.com/1376/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=ios.wordpress.org&blog=3882653&post=1376&subd=wpiphone&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 25 Mar 2013 18:30:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:3:"Dan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:21;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 3/25";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12819";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/J5kgleppg3E/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1264:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/easy-watermark/"><strong>Easy Watermark</strong></a> automatically adds watermark to images when they are uploaded.</p>\n<p><a href="http://wordpress.org/extend/plugins/cat-signal/"><strong>Internet Defense League Cat Signal</strong></a> automatically loads either the modal or the banner Cat Signal when there is an active campaign from <a href="http://internetdefenseleague.org">the Internet Defense League</a>.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://calendarscripts.info/autoresponder-wordpress.html"><strong>BFT Autoresponder</strong></a> allows scheduling of automated autoresponder messages and managing a mailing list.</p>\n<p><a href="http://wordpress.org/extend/plugins/google-analytics-dashboard-for-wp/"><strong>Google Analytics Dashboard for WP</strong></a> will display Google Analytics data and statistics inside your Dashboard.</p>\n<p><a href="http://wordpress.org/extend/plugins/wordpress-mu-domain-mapping/"><strong>WordPress MU Domain Mapping</strong></a> allows users of a WordPress MU site or WordPress 3.0 network to map their blog/site to another domain.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/J5kgleppg3E" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon,