g.wordpress.com/2013/03/18/get-involved/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1594:"<p>WordPress.tv is now open for video submissions from the WordPress community.</p>\n<p>Do you record your WordPress meetup?<a href="http://wordpress.tv/submit-video/">Submit it to WordPress.tv!</a>Do you record WordPress screencast tutorials?<a href="http://wordpress.tv/submit-video/">Submit them to WordPress.tv!</a>Do you create some other form of WP video awesomesauce that would benefit the community? WordPress.tv might be just the place for it.</p>\n<p>Fair warning: Our intrepid group of WordPress.tv event video moderators already works hard to review and publish WordCamp videos, and if WordPress.tv is suddenly flooded with video submissions, they may take a while to get around to reviewing and publishing your video. Please be patient as we iterate toward success&#8230; and if you&#8217;re interested in donating your time toward becoming a WordPress.tv moderator, please apply<a href="http://wordpress.tv/apply-to-be-a-wordpress-tv-moderator/">here</a>. If this takes off like we think it might, we will definitely need some extra eyes!</p>\n<p>Thanks in advance for helping to make WordPress.tv an even more fantastic resource. If you have questions about this, please don&#8217;t hesitate to ask.</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/291/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/291/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wptvblog.wordpress.com&blog=5310177&post=291&subd=wptvblog&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 18 Mar 2013 08:57:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:16:"Andrea Middleton";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:34;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:29:"Alex King: Announcing Threads";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=16176";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:54:"http://alexking.org/blog/2013/03/17/announcing-threads";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2417:".threads-post-notice {\n	background: #e8e8e8;\n	padding: 10px;\n}\n.threads-post-notice a {\n	font-weight: bold;\n}\n\n<p><img src="http://alexking.org/wp-content/uploads/2013/03/threads-timeline-510x382.jpg" alt="threads-timeline" width="480" height="359" class="aligncenter size-medium-img wp-image-16181" /></p>\n<p>I&#8217;ve just released an initial beta of <a href="http://wordpress.org/extend/plugins/threads/">Threads</a>, a WordPress plugin I&#8217;ve been working on for about a year. The idea is simple: show posts that comprise a single overall story/topic in a timeline. Then link to that timeline from the posts so that your readers have a chance to get more historical context about a post without you having to link back to 20 previous posts.</p>\n<p>Here are some example threads:</p>\n<ul>\n<li><a href="http://alexking.org/blog/thread/social">Social</a></li>\n<li><a href="http://alexking.org/blog/thread/hard-drive-recovery">My Hard Drive Recovery Saga</a></li>\n<li><a href="http://alexking.org/blog/thread/twitter-tools">Twitter Tools</a></li>\n<li><a href="http://alexking.org/blog/thread/passwords">Passwords</a></li>\n<li><a href="http://alexking.org/blog/thread/weight-loss">Weight Loss</a></li>\n</ul>\n<p>As you can see on this site, the thread timeline is responsive and retina/HiDPI ready. Also included is a sidebar widget to show recently active threads and a shortcode so that you can embed a thread timeline in a page.</p>\n<p>Give it a spin &#8211; I hope it works out well for you!</p>\n<p>A quick note about support: As this is a free plugin released under the GPL I am offering only &#8220;Product Support&#8221; for this plugin. That means I will do my best to fix bugs and usabiity issues that are posted on the <a href="http://wordpress.org/support/">WordPress support forums</a>. Contrast this with &#8220;User Support&#8221; which we offer for all of <a href="http://crowdfavorite.com">Crowd Favorite</a>&#8216;s commercial products. With &#8220;User Support&#8221; we do our best to troubleshoot and address each customer&#8217;s issues.</p>\n<p>Developers, contributions are welcome on <a href="https://github.com/crowdfavorite/wp-threads">GitHub</a>.</p>\n<p class="threads-post-notice">This post is part of the thread: <a href="http://alexking.org/blog/thread/content">Content Presentation</a> &#8211; an ongoing story on this site. View the thread timeline for more context on this post.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 17 Mar 2013 21:35:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:35;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";