(322, '_transient_dash_aa95765b5cc111c56d5993d476b1c2f0', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://markjaquith.wordpress.com/2013/04/04/wordpress-36-shortcode-attribute-filter/'' title=''Since WordPress 3.6 is in beta, I thought Id use this nearly-abandoned blog (hey, been busy working on WordPress!) to talk about some of the cool stuff for developers. For the first installment, check out the new shortcode_atts_{$shortcode} filter. The shortcode_atts() function now accepts a third parameter  the name of the shortcode  which enables the ru [&hellip;]''>Mark Jaquith: WordPress 3.6: shortcode_atts_{$shortcode} filter</a></li><li><a class=''rsswidget'' href=''http://wordpress.org/news/2013/04/wordpress-3-6-beta-1/'' title=''WordPress 3.6 Beta 1 is now available! This is software still in development andwe reallydont recommend that you run it on a production site set up a test site just to play with the new version.To test WordPress 3.6, try theWordPress Beta Testerplugin (youll want bleeding edge nightlies). Or you candownload the beta here(zip). Weve been working [&hellip;]''>Dev Blog: WordPress 3.6 Beta 1</a></li><li><a class=''rsswidget'' href=''http://dougal.gunters.org/blog/2013/04/04/dougal-campbell-codepoet-interview/'' title=''I was honored to be chosen for an interview on CodePoet. Though I havent been able to stay as involved with WordPress as much lately as Id like, due to job and family, I guess Im of historical interest because of my involvement as a core developer back in the first couple of years. (I jest  a little) We discuss how I came to web development and from th [&hellip;]''>Dougal Campbell: CodePoet Interview</a></li><li><a class=''rsswidget'' href=''http://blog.gravatar.com/2013/04/03/gravatar-and-wordpress-com-together-forever/'' title=''Did you know that your Gravatar.com account has always been a WordPress.com account? Its true. Back in 2007 we (Automattic) acquired Gravatar. Heading into 2008 we rewrote it in PHP, and ever since then, its been using the same integrated user system as WordPress.com for accounts. Previously we handled that behind the scenes, but we found that it made th [&hellip;]''>Gravatar: Gravatar and WordPress.com, Together Forever</a></li><li><a class=''rsswidget'' href=''http://wordpress.tv/2013/03/31/understanding-the-wordpress-add-new-user-screen/'' title='' [&hellip;]''>WordPress.tv: Understanding the WordPress Add New User Screen</a></li></ul></div>', 'no'),
