(36, 1, '2013-04-05 04:51:00', '2013-04-05 04:51:00', 'Automation and visibility for business processes at all levels in the organization. Our products and practices provide you with actionable insights.\r\nTight synchronization with your business team means reduced cycle times and faster deployments. Our detailed planning, high quality work and measurable results produce higher customer satisfaction.\r\nPulse Check\r\nYou can track availability of customer facing end points. You can monitor one or more end points like website(s), exposed Service(s) and some category of devices. When a monitored end point is down or is responding very slow, you will receive a notification. This gives you the ability to know and act on a failure, before your customer does.\r\nProject Visualization\r\nWe can improve on your ability to execute projects better, by helping you visualize your projects. You can view metrics like project alignment with business, actual vs. plan hours, resource utilization rate, objective measurement of project completion, deliverables tracking and strength of current forecast. You can view artifacts related to the project and gain insight into hiring needs. It is our belief, that the capability to visualize projects, will help you improve the top line growth for your business.\r\nProcess Visualization\r\nHow efficient is your operations? Visualize your business process for existing gaps, compliance or lack thereof and ability to scale. You can do risk analysis, root cause analysis, get audit reports and receive alerts for activities running beyond a threshold. You can get different views of the business process like people, process and location dimensions. You can baseline and compare against throughput and volume benchmarks.\r\nAsset Visualization\r\nDepending on your line of business, your definition of an asset might be anything from wind mill, holdings or a medical device. But they all have very similar challenges. You would like to know if your asset is currently available and responding, uptime, preventive maintenance schedule and adherence, usage tracking, cost of ownership like purchase, repair and related expenses, cost benefit analysis of suppliers / models and productivity of technicians. We can tag or collect signal from capable assets to track their location.\r\nPlant Visualization\r\nYou want to gain visibility into your manufacturing plant operations or the assembly line in production. You as a plant supervisor, might want to see how full the boiler is, get an alarm should the content level fall below a threshold and get a visual simulation of the actual input, output, activity and interaction based on real time data from devices. By leveraging our partnership with a leading industrial automation provider, we can set you up with the equivalent of a command and control center for your manufacturing plant.', 'Product', '', 'publish', 'closed', 'closed', '', 'product', '', '', '2013-04-07 14:28:34', '2013-04-07 14:28:34', '', 0, 'http://localhost/wordpress/?page_id=36', 2, 'page', '', 0),
