(83, 1, '2013-04-05 05:14:28', '2013-04-05 05:14:28', 'With our services, you will have increased efficiency, lower cost and higher ROI. Our proven systems and processes are engineered to provide the best solutions.\r\nKanvera provides the following end to end services.\r\nVisibility for business operations with dashboard and score cards.\r\nAnalytics and data mining.\r\nAutomate business processes and compliance monitoring.\r\nAutomation to help align enterprise project initiatives with business goals.\r\nDocument management solutions and document centric work flow automation.\r\nReport generation, subscription and management.\r\nPortal solutions for team collaboration.\r\nExtract, data transformation and data load.\r\nFor health care vertical, we provide the following specialized services.\r\nHelp realize incentives by achieving meaningful use (HITECH act).\r\nIntegration and interfacing with heterogeneous systems.\r\nInformatics to improve patient health, lower cost and size exposure to risk.\r\nReplace paper with digital communications.\r\nPopulation sizing and analytics.\r\nSourcing and distribution of administrative and clinical data thru Health Information Exchange.\r\nHelp you meet 5010, ICD 10 compliance and benefit from it.\r\nLeverage cloud and mobile platform to build next generation solutions.', 'Services', '', 'inherit', 'open', 'open', '', '58-revision-2', '', '', '2013-04-05 05:14:28', '2013-04-05 05:14:28', '', 58, 'http://localhost/wordpress/?p=83', 0, 'revision', '', 0),
