s currently available and responding, uptime, preventive maintenance schedule and adherence, usage tracking, cost of ownership like purchase, repair and related expenses, cost benefit analysis of suppliers / models and productivity of technicians. We can tag or collect signal from capable assets to track their location.\r\nPlant Visualization\r\nYou want to gain visibility into your manufacturing plant operations or the assembly line in production. You as a plant supervisor, might want to see how full the boiler is, get an alarm should the content level fall below a threshold and get a visual simulation of the actual input, output, activity and interaction based on real time data from devices. By leveraging our partnership with a leading industrial automation provider, we can set you up with the equivalent of a command and control center for your manufacturing plant.', 'Clients', '', 'inherit', 'open', 'open', '', '53-revision-3', '', '', '2013-04-05 05:14:19', '2013-04-05 05:14:19', '', 53, 'http://localhost/wordpress/?p=87', 0, 'revision', '', 0),
