(89, 1, '2013-04-05 04:44:09', '2013-04-05 04:44:09', 'We specialize in Informatics to size risk and increase outcomes. We provide implementation services for electronic data exchange and guidance for 5010, ICD 10 compliance and achieving meaningful use.', ' Focus Solutions for Healthcare', '', 'inherit', 'open', 'open', '', '16-revision-3', '', '', '2013-04-05 04:44:09', '2013-04-05 04:44:09', '', 16, 'http://localhost/wordpress/?p=89', 0, 'revision', '', 0),
(90, 1, '2013-04-05 04:42:39', '2013-04-05 04:42:39', 'We integrate heterogeneous systems to provide a consolidate view of business operations, so that your team has more time to focus on most critical business functions.\r\n', ' Business Process Automation', '', 'inherit', 'open', 'open', '', '1-revision-9', '', '', '2013-04-05 04:42:39', '2013-04-05 04:42:39', '', 1, 'http://localhost/wordpress/?p=90', 0, 'revision', '', 0),
